(2, 'Eric Jones', '', 'eric@talkwithcustomer.com', 'Hello ralfitness.in,\n\nPeople ask, why does TalkWithCustomer work so well?\n\nIts simple.\n\nTalkWithCustomer enables you to connect with a prospective customer at EXACTLY the Perfect Time.\n\n- NOT one week, two weeks, three weeks after theyve checked out your website ralfitness.in.\n- NOT with a form letter style email that looks like it was written by a bot.\n- NOT with a robocall that could come at any time out of the blue.\n\nTalkWithCustomer connects you to that person within seconds of THEM asking to hear from YOU.\n\nThey kick off the conversation.\n\nThey take that first step.\n\nThey ask to hear from you regarding what you have to offer and how it can make their life better. \n\nAnd it happens almost immediately. In real time. While theyre still looking over your website ralfitness.in, trying to make up their mind whether you are right for them.\n\nWhen you connect with them at that very moment its the ultimate in Perfect Timing  as one famous marketer put it, youre entering the conversation already going on in their mind.\n\nYou cant find a better opportunity than that.\n\nAnd you cant find an easier way to seize that chance than TalkWithCustomer. \n\nCLICK HERE http://www.talkwithcustomer.com now to take a free, 14-day test drive and see what a difference Perfect Timing can make to your business.\n\nSincerely,\nEric\n\nPS:  If youre wondering whether NOW is the perfect time to try TalkWithCustomer, ask yourself this:\nWill doing what Im already doing now produce up to 100X more leads?\nBecause those are the kinds of results we know TalkWithCustomer can deliver.  \nIt shouldnt even be a question, especially since it will cost you ZERO to give it a try. \nCLICK HERE http://www.talkwithcustomer.com to start your free 14-day test drive today.\n\nIf you\'d like to unsubscribe click here http://liveserveronline.com/talkwithcustomer.aspx?d=ralfitness.in\n', '2019-10-05 01:42:22', '2019-10-05 01:42:22'),
(3, 'Y SRIMUKHA', '8147547696', 'srimukha.yalavarti@yahoo.com', 'Looking forward to start the 6 month course. Let me know how do I take this forward. ', '2019-10-05 06:41:06', '2019-10-05 06:41:06'),
(5, 'Shashank Amarnath', '9901718461', 'shash141991@gmail.com', 'Hi,\r\n\r\nMy name is Shashank. I have been following you on instagram and want to join your 6 month online training program. I have opted for the monthly billing option and paid as prompted by razorpay. I have received a mail saying that the subscription has started but have not received any other confirmation mail. Also, I have not been charged the amount i.e Rs.2667/-\r\n\r\nKindly advise the procedure for proceeding with the same. \r\n\r\nRegards, \r\n\r\nShashank \r\n', '2019-10-09 10:51:58', '2019-10-09 10:51:58'),
(8, 'Alex', '8792163461', 'alexanderthomas512@gmail.com', 'Only Whatsapp calls available. Lets schedule and connect over the phone. I would like to know more about the training.', '2019-10-13 20:09:11', '2019-10-13 20:09:11'),
(10, 'pavan', '9738999853', 'pavan@ralfitness.in', 'God of wind', '2019-10-15 04:35:08', '2019-10-15 04:35:08'),
(11, 'pavu', '9738999853', 'pavan@ralfitness.in', 'geooooo sup', '2019-10-15 04:37:34', '2019-10-15 04:37:34'),
(13, 'Shankar Elango', '9600528450', 'eshankar.mech@gmail.com', 'Hi\r\nI am interested in enrolling the program but have a query as how do you ensure our form is correct while working out and how can it be corrected then and there?\r\nI am more prone to injury and so wanted to double check this point.\r\nThanks\r\nShankar', '2019-10-16 09:03:11', '2019-10-16 09:03:11'),
(14, 'Abhishek munian', '9833422053', 'abhishek.munian@gmail.com', 'Hi Ralston, I am Abhishek from the Social Media team that handles communications for Saffola Fittify - https://saffolafittify.com/ a range of healthy gourmet products. \r\n\r\nWe would like to explore the possibilities of having you on board for a long-term association with you. \r\n\r\nYou can drop me a text on 9833422053 if you would like to take this ahead.  ', '2019-10-22 14:57:40', '2019-10-22 14:57:40'),
(15, 'Abhishek munian', '9833422053', 'abhishek.munian@hiveminds.in', 'Dear Ralston,\r\n\r\nI am writing to you on behalf of Saffola Fittify Gourmet, from Marico, a range of food and beverage products with a focus on healthy Superfood based nutrition, for a long term Influencer Collaboration request. Your content on Pilates and fitness is highly engaging and has a fantastic connect with the audience you speak to on Instagram and Youtube, and we\'d like to share our idea for the collaboration with you. \r\n\r\nThe objective is to promote a #HealthierChoice when it comes to nutrition and beverage choices through the brand, and we feel that as an influencer you would be able to create a relevant, meaningful connection with audiences through exciting content around Saffola Fittify products enriching your life and health. Sharing a more detailed brief for your reference below.\r\n\r\nGoal: To integrate Saffola Fittify product into influencers story/lifestyle through social media channels in an organic, natural manner to influence followers to consider the brand. We wont intend to make it a pushy promotion of brand, but hope to bring out the benefits as seems fit through the content. \r\n\r\nAbout the brand: Saffola Fittify is Indias 1st Healthy Gourmet Breakfast to Dinner Range, which has been carefully created by nutritionists and curated by Masterchef India judge & Chef Kunal Kapu, to combine the best of taste with health for a fitter life. The products are crafted with hand-picked natural superfoods (like Moringa) and designed to seamlessly integrate into your daily routine. The range includes: \r\n\r\n         Super Meals:  Hi-Protein Slim Meal-Shakes, Hi-Protein Meal-Soups\r\n         Super beverages: Green Coffee, Superfood Moringa Green Tea\r\n         Power Breakfasts: Superfood Millet Upma/Poha + Superfood Quinoa Upma/Poha\r\n\r\nThe process we had in mind is to let you pick 2 products from the range which you wish to try or like, experience the products and work together on crafting the social outreach and posts thereafter. We would love to know if you would be interested in the collaboration, so we can give you a detailed brief on call to discuss the costing and process. \r\n\r\nWe look forward to hearing from you!\r\n\r\nP.S. Do feel free to explore the Saffola Fittify Social Handles to understand more about the brand and how we have been engaging with our followers. \r\nhttps://www.instagram.com/saffolafittify/  \r\nhttps://www.facebook.com/SaffolaFittify/', '2019-10-22 15:06:21', '2019-10-22 15:06:21'),
(16, 'Aparna', '0521992255', 'aparna.gopalkrishnan@gmail.com', 'Hi. I want to join your fitness program. Can you please tell me if you have any discounts for diwali?', '2019-10-23 14:43:09', '2019-10-23 14:43:09'),
(17, 'abid bajracharya', '9801017595', 'abidbajre@gmail.com', 'I want to enroll for 3 months membership but as i am from Nepal and donot have any of the possible payment method mentioned , is there any other way i can proceed with payment or shall i ask some Indian friend to pay for me and register in my name. \r\nAlso would like a sneak preview of the program/ service you provide. \r\nthanks ', '2019-10-24 11:33:46', '2019-10-24 11:33:46'),
(18, 'Vishnu', '9496807623', 'vishnu.surabhy@gmail.com', 'My average weight for last 7,8 years is 50kg. My age is 27. I want to gain weight. Already undergoing weight training for last 3 months.', '2019-10-24 22:18:32', '2019-10-24 22:18:32'),
(19, 'DEEPTESH patel', '9979575101', 'dipteshpatel1986@yahoo.com', 'Hey bro I would like to enroll your 6 month program for weight loss', '2019-10-25 16:43:16', '2019-10-25 16:43:16'),
(20, 'Shrey Agarwal', '8860013243', 'shreyagarwallt12@gmail.com', 'The monthly subscription in 6 months plan does monthly deduction of money or does it levy an interest on monthly EMI', '2019-10-25 17:24:35', '2019-10-25 17:24:35'),
(21, 'Vishnu', '9496807623', 'vishnu.surabhy@gmail.com', 'IAM a banker.  My average weight is 50. Want to gain weight.', '2019-10-25 23:21:37', '2019-10-25 23:21:37'),
(22, 'shivani Setty', '9900096850', 'shivanisetty@gmail.com', 'Hi, I am considering enrolling for your three month program. Wanted to understand the consultation process in terms of how the diets and workouts are - just to assess if this is something I can do. \r\n\r\n', '2019-10-26 12:39:51', '2019-10-26 12:39:51'),
(23, 'Hitesh Amin', '9773075072', 'aminhitesh9@gmail.com', 'Hi team,\r\n\r\nCan you please elaborate on the 6 months coaching plan and provide details on how the monthly billing works?', '2019-10-26 15:00:16', '2019-10-26 15:00:16'),
(24, 'Aswathi J N', '9892801061', 'aswathi87@gmail.com', 'Hi\r\nIf I pay up now, will it be possible to start the plan by Nov end/Dec beg? Just going to be living out a hotel for month, no access to a kitchen. And can the diet be customised like to not include gluten/dairy? \r\n', '2019-10-26 15:07:31', '2019-10-26 15:07:31'),
(25, 'Sashidharan', '9791528035', 'sashidharan5262@gmail.com', 'Hey brother I want to clarify onething about your Dewali offer! I want to avail your 3months couple plan in this offer period. but I wanted it to strt after some days on sep 15th or after that. Is it possible brother??? ', '2019-10-27 17:10:11', '2019-10-27 17:10:11'),
(26, 'Harshitha K S', '9606632230', 'imgharshithaks2000@gmail.com', 'Hello sir ,\nI am Harshitha K S from Mysore . I have been following your blog from past many days and its very inspiring . \nI have been facing these issues of binge eating since 6 months maybe because of the diet  I was following that was way too strict and so much cardio . Though I lost so much of weight and was about 63 kg but after I started this over eating and binge eating and all ,  I gained so much weight back . I now almost weigh 73 kilos . This is the highest weight I have ever gained . I thought I would get over it but its too difficult for me than I thought it would be . I tried to lose weight again but no my weight remains the same no matter what I do. \nThe other day I came across your page in instagram and it made me feel that i could get back to my normal eating , lose some weight and stop thinking about food all the time .\nSo I really want to give me a chance with this . I thought of taking the 3 month package and give it a try .\n\nSo may I be able to get more information about it and also the further steps to be taken to pay the fees and what are the procedures through which you guide ?\n\nThank you so much for your patient reading .\nWill be waiting for your reply ,\n\nRegards ,\nHarshitha', '2019-10-27 19:15:13', '2019-10-27 19:15:13'),
(27, 'kanish shetty', '8108676489', 'shettykanish@gmail.com', 'I have opted for the 6 month plan but i have not received any confirmation from your end', '2019-10-28 02:54:36', '2019-10-28 02:54:36'),
(28, 'Aneri Shah', '8080990010', 'anerishah1304@gmail.com', 'Hi, I don\'t wish to join gym as I am constantly traveling. Can you still help and make my exercise plans based on portable exercise tools like resistance bands?', '2019-10-28 23:42:36', '2019-10-28 23:42:36'),
(29, 'Chama Venkat Teja', '9902653903', 'teja77021@gmail.com', 'I have Paid for the 3 month Plan Today.\r\nWill you guys get in touch with me?\r\n', '2019-10-29 19:57:12', '2019-10-29 19:57:12'),
(30, 'Vivek Mohan', '9845702211', 'vivekmohan@resil.com', 'Hey! \r\nMy name is Vivek and I\'ve been following your Instagram page for the past two months. It\'s really good to see the transformation and the satisfaction of all the clients that have signed up with you. My weight is currently around 115kgs and I would like to cut the same, to start with I would like to sign up for a 3 months training and nutrition package and further extend based on the results. I would like to start the same this coming Monday, please let me know your availability so we can get in touch.\r\nThank you!', '2019-10-30 11:32:15', '2019-10-30 11:32:15'),
(31, 'Dhanya Mohan', '9620065533', 'dhanya_mohannair@yahoo.com', 'Hi! My name is Dhanya Mohan. I\'m 25 years old, and I am trying to loose weight. I went through your customer testimonies was really impressed. I would really like your help.', '2019-10-30 12:09:37', '2019-10-30 12:09:37'),
(32, 'Cn vinod', '9922545150', 'vinubinu@gmail.com', 'Hi coach', '2019-10-30 12:15:17', '2019-10-30 12:15:17'),
(33, 'Tanvi Mokal', '8007278073', 'tanvimokal123@gmail.com', 'I wanted to know about services, and do ua\'l have installment services as well?', '2019-10-30 13:06:19', '2019-10-30 13:06:19'),
(34, 'Asjad nabil', '9901761564', 'asjadnabil6@gmail.com', 'Hi! I\'m a subscriber of yours from a long time, I wanted to know if you can help me heal metabolic adaptation. I\'ve done everything to get it right from almost 3 years nothing has worked, I even hired a nutritionist to help me and that didn\'t help. \r\n', '2019-10-30 13:22:37', '2019-10-30 13:22:37'),
(35, 'Dhanya Mohan', '9620065533', 'dhanyamohan@resil.com', 'Hi! My name is Dhanya Mohan. I\'m 25 years old and am looking to loose weight. I came across your website and found the customer testimonies to be really impressive. I would like to use your help. Looking forward to hearing from you! \r\n\r\nThanks and Regards.', '2019-10-31 13:28:55', '2019-10-31 13:28:55'),
(36, 'Viraj Soni', '9860577388', 'viraj@translatez.co', 'Hi guys, I\'ve been following your Instagram page for quite some time. I really admire the work you do.\r\n\r\nI am thinking to get onboarded on a plan with you and I had a couple of questions. It would be great if you can get back on it.\r\n\r\n- I don\'t eat bread and sugar. Would it be possible to design meal plans around it?\r\n- I am a regular runner and it\'s stopped for some time now. I would enjoy if there were runs incorporated in the training plan. Is that something which you can help build around?\r\n\r\nThanks', '2019-10-31 13:38:56', '2019-10-31 13:38:56'),
(37, 'Jerome ', '8217897490', 'jeromehere@gmail.com', 'Hi Team!\r\nI just wanted to know if signing up with you would be beneficial to me if I have no experience whatsoever at the gym?', '2019-10-31 20:01:27', '2019-10-31 20:01:27'),
(38, 'Anuj Gupta', '9839204311', 'narainielectroworld@gmail.com', 'I would like to enroll for 6 months plan..kindly guide me how to complete the process.', '2019-11-02 00:35:48', '2019-11-02 00:35:48'),
(39, 'Sudha', '9845092834', 'sue.sudha@gmail.com', 'Hi, \r\nI\'d like some information as to how the program works.', '2019-11-02 09:58:15', '2019-11-02 09:58:15'),
(40, 'Vinil Anil Kumar', '9663616846', 'vinil9327@gmail.com', 'Hi,\r\nI came across your Instagram profile and Im really impressed! Hence Im writing this to you.\r\nIm looking forward to transform my body. Brief introduction about my lifestyle. I hit the gym 5 days a week. So far Ive lost from 115kilos to 85kilos in 2 years. Right now Ive started to gain weight again which kinda worries me.\r\nAlthough Ive lost in numbers, I dont see a significant change in my appearance. Ive gained a little strength and nothing much or maybe Im expecting a lot haha.\r\nWith regards to injuries, I recently had a partial ACL.\r\nI work as a designer so my work life is mostly sedentary. \r\nWith respect to food, I was on intermittent fasting for 1 year and 7 months. Right now Im just eating clean and partially calculating my macros. And I consume a scoop of vegan pea protein. I eat almost everything except diary products. Have a cheat meal once a week.\r\nIm also considering to switch to a vegan diet as well.\r\nI used to consume alcohol occasionally but not anymore. Its been about a year since I quit. And Ive never smoked.\r\nId be happy to get some assistance from you regarding my transformation. \r\nIf things go well Im more than happy to enrol! \r\nLooking forward to hearing from you. \r\nHave a great weekend :) ', '2019-11-02 13:12:27', '2019-11-02 13:12:27'),
(41, 'Bhargav S Vasist', '9972955119', 'bhargavclick@gmail.com', 'Hey, \r\nI was interested in the 6-month package and I clicked on the monthly billing option and I was charged 5Rs.\r\nDoes this mean the membership plan has started?\r\nI\'m not sure.\r\nHere is the reference number (pay_Dbu9iDByp628Ii)\r\nCould you help me out', '2019-11-03 20:27:13', '2019-11-03 20:27:13'),
(42, 'Navdeep Malik', '9733377816', 'malik.navdeep@yahoo.com', 'Hi,\r\nI would like to inquire for couples program.\r\nPlease let me know if we can have call.\r\nI have US number - +1-973-337-37816.\r\n\r\nThanks.', '2019-11-06 06:30:26', '2019-11-06 06:30:26'),
(43, 'Neelaveni', '8095788444', 'infoneelu.777@gmail.com', 'I need to know detail plan and process', '2019-11-06 17:42:32', '2019-11-06 17:42:32'),
(44, 'HARSHA Sandeep CHALLA', '5175802202', 'harshano420@gmail.com', 'Hey\r\n\r\nI signed up for the 6 months couple program(Subscription ID: sub_Df7XeVydUGV1CO) but haven\'t received any followup on this, so just wanted to check.\r\n\r\nThanks\r\nHarsha\r\n51-580-2202', '2019-11-13 05:47:56', '2019-11-13 05:47:56'),
(45, 'Jayjeet Debroy', '8876653075', 'debroyjayjeet@gmail.com', 'I wanted to know what type of training and diet does the program include. I have been training as a powerlifter for one year, so I want to know if this program will match my needs before paying for it. Thank you! ', '2019-11-15 22:08:29', '2019-11-15 22:08:29'),
(46, 'Arvind Vidyashankar', '2135317774', 'vj.arvind@gmail.com', 'Hi,\r\n\r\nI am looking to gain weight and improve my diet. My primary focus is to get healthy by creating a routine fitness regime incorporating nutritional vegetarian diet and daily exercise. Looking for personalized guidance for both aspects. \r\n\r\nI\'ve been following Ralston\'s videos since the beginning and believe that this coaching could benefit me. Do you think it is possible to train me online? I live in Seattle, USA.\r\n\r\nThanks.', '2019-11-18 10:23:59', '2019-11-18 10:23:59'),
