(129, 'Dharanesh', '4754491461', 'dharanesh.amf49@gmail.com', 'Hi,\r\nI would like to know more details like I live in USA and how could you monitor me with my food intake and workout plan. Please share more details so that I can jump in and be part of ralfitness.\r\n\r\nThanks,\r\nDharanesh', '2020-01-31 16:45:04', '2020-01-31 16:45:04'),
