(153, 'Hari', '0420652930', 'hari.manvi@gmail.com', 'Im skinny guy, under weight according to my height. I want to gain muscle and good body like a professional body builder. O had a doubt abt the payment plan for 12 months, how much can I pay monthly for that 12 months deal.', '2020-03-01 09:11:56', '2020-03-01 09:11:56'),
(154, 'Varsha Kishore ', '4372272378', 'varshakishore@gmail.com', 'Hey! \r\nI was wondering if I absolutely have to go to the gym to enroll into your program. I workout at home, do a combination of HIIT body weight exercises and do strength with dumbbells. It\'s impossible for me to go to the gym at the moment because of a few reasons. I can dedicate an hour to work out at home. Please let me know. My goal is to lose 5kgs. I plan to start with the 3 months plan. Please let me know. ', '2020-03-02 04:22:05', '2020-03-02 04:22:05'),
(155, 'Avantika Andhare', '7829910182', 'avantikaandhare21@gmail.com', 'I would like a personalized workout routine. I am a marathon runner and swimmer. Been doing weight training for years now. I want to build strength and my body fat % is high. Need to work on it. \r\nThank you', '2020-03-03 16:03:55', '2020-03-03 16:03:55'),
(156, 'Rahul Ramnani', '9945854588', 'rrramnani@gmail.com', 'Hi,\r\n\r\nAs somebody who has failed to look after my health these last few years Im looking to get back on track. The weight Ive put on recently is starting to take its toll on my personal and professional life and I want to remedy that. Would love to work with you guys since this is sort of solution that Ive been seeking', '2020-03-04 00:55:11', '2020-03-04 00:55:11'),
(157, 'Jebakumar Lazares J', '9789701940', 'jebakumarlazarus@gmail.com', 'MY AGE IS 21  MY WEIGHT IS 64KG AND MY HEIGHT IS 174CM. I USED TO GO TO THE GYM IN THE COLLEGE .  I GOT SOME SOME CHANGES IN THE SHAPE BUT MY MUSCLE GROWTH REMAINS SAME. NOW I AM GOING TO COMPLETE MY UG. I NEED TO BUILD MUSCLE AS WELL AS I NEED TO BULK A LITTLE. WHICH PLAN WILL SUIT ME?? ', '2020-03-04 21:54:15', '2020-03-04 21:54:15'),
(158, 'Anil monteiro', '9880595604', 'anilpmonteiro@gmail.com', 'Hi Ralston, for some reason am unable to see weight reduction. Inspite of following the diet. Could be my own situation of travel. I would like to pause the program here for 2 months and then start. \r\nAlso that I keep travelling, sometimes causes disturbance in the diet. I continue to be in between 83 to 85kgs. Let me hold and then start. \r\nAnil Monteiro ', '2020-03-05 06:32:15', '2020-03-05 06:32:15'),
