(164, 'sunder kesavan', '9629146904', 'sveranipet@gmail.com', 'Hello. This is sunder. From vellore tamil nadu. I live in a remote place where i dont get things very eailsy.  i have to travel far for my basic things. Isbit possible to do workout plan and the meal plan very simple. Will it work for my weight loss. ', '2020-03-09 17:19:23', '2020-03-09 17:19:23'),
(165, 'Rohit Mishra', '9620263056', 'rohit22rm@gmail.com', 'Hey, I was thinking of joining your program. But I would really like someone to talk to me and explain how would it work for me. I am a professional poker player and have a very irregular routine not to add the toxic lifestyle and habits. But I think it\'s time to get the best of me out. So would love to have a talk before I make the payment.', '2020-03-09 19:23:26', '2020-03-09 19:23:26'),
(166, 'Aatif Dalvi', '9999999999', 'aatifdalvi@yahoo.in', 'Hi there,\r\nI am 31 year old weighing about 77kg for now with height 5\'8.. i usually maintain my calorie count except for weekends... i reduced from 84 to 73 around last year just with 1000 calorie plan hoever since im not into veggies i had digestion issues that made me stop the self diet i was following... i wish to ask you how can you help me to achieve my weight loss with minimal gym... i dont do gym as im restricted on time during the week though i wish to know if you can help me achieve the six pack dream with wasy diet and home exercises to achieve my goal .. ill wait for tour replly of what i can expect overall from 3 months package you offer..\r\n\r\nIm an indian workint im doha qatar and so the number i put is wrong my whatsapp number is +974-70080250', '2020-03-10 12:12:08', '2020-03-10 12:12:08'),
(167, 'Harshitha Appaiah K', '8105928510', 'harshkoothanda@gmail.com', 'I live in a hostel and want to know if its feasible to go ahead with the program\r\n', '2020-03-19 09:42:31', '2020-03-19 09:42:31'),
(168, 'Netra Sharma', '8884074998', 'netravathi@nowmedia.in', 'Hi!\r\nMy name is Netra and I would like to get in touch with Ral Fitness\'s Head of Marketing. I have left my email and my phone number and I hope you\'ll get back to me. Thank you so much!', '2020-03-19 13:02:16', '2020-03-19 13:02:16'),
(169, 'Vikas', '7974777096', 'vikkylv7819@gmail.com', 'Want CSCS certification??', '2020-03-26 16:29:07', '2020-03-26 16:29:07'),
(170, 'Namrata Goplani', '9999999999', 'namrata.goplani@gmail.com', 'I was trying to make a payment to enroll but it was declined by my bank first to verify my identity. After I confirmed that, they asked me to ask the merchant (you) to reprocess the transaction. Please confirm if you can reprocess it. Thank you! you can reach me on my number mentioned here: +1 585 309 5893. \r\nThank you so much. I look forward to training with you :)', '2020-03-26 23:16:58', '2020-03-26 23:16:58'),
(171, 'Manikandan', '9204283404', 'ravimanikandan@gmail.com', 'I live outside of india.do you offer programs for people outside of india', '2020-03-28 10:18:19', '2020-03-28 10:18:19'),
(172, 'Nikhil giri', '9304555761', 'nikhil.giri99@gmail.com', 'Hii sir.. i m nikhil from Allahabad university student. I m interested to take ur training.. but fees is much higher...if u felt that u can teach me cheaply then plss..i ll b kind to u\r\nI can expend 3000 for 3 mnths..so plss tell me sir..if u cant then no problem.\r\nThank u sir', '2020-04-04 23:23:47', '2020-04-04 23:23:47'),
(173, 'Apoorva', '9945544402', 'mapoorva21@gmail.com', 'Hello \r\n\r\nI have few questions regarding the services offered.\r\n\r\nI have issues with my knees, as I\'ve had patellar dislocation in both my knees in the past.  With heavy load the dislocation can repeat again. Hence I\'m adviced to avoid workouts which has a direct effect on the knees eg lunges , squats . So this eliminates major excercise options for me \r\nHow does your services fit into these kind of situations ? \r\n\r\nThanks\r\n', '2020-04-05 03:16:47', '2020-04-05 03:16:47'),
(174, 'Haritha Gorthi', '8801581025', 'harithagorthi@gmail.com', 'I just paid for a membership. How do I proceed with the availing of the services?', '2020-04-07 21:58:15', '2020-04-07 21:58:15'),
(175, 'Muneeb Akhtar', '9550776979', 'muneebakhtar22@gmail.com', 'Hey, \r\nI\'m trying to loose weight, I fell off real bad from my game. I need help.', '2020-04-15 04:20:11', '2020-04-15 04:20:11'),
