(184, 'Sukanya Senapaty', '8884304875', 'sukanya.senapaty@gmail.com', 'Hi guys, \r\nI opted for the 3 months program and I haven\'t heard back from you guys. So wanted to know as to when can we start with the plan. Thanks!', '2020-05-06 16:59:24', '2020-05-06 16:59:24'),
(185, 'Aarti karwayun ', '9740072024', 'aartikarwayun@gmail.com', 'I was in touch on Instagram and would like to take the 6months option with monthly instalments. Please get back to me. I would like to start from 15 May.', '2020-05-08 17:40:46', '2020-05-08 17:40:46'),
(186, 'Shubham Agrawal', '7532070255', 'shubhamagrawal313@gmail.com', 'I m little confused towards joining the program as frankly speaking I am quite lazy person and not a big fan of workouts. So I was wondering  if you guys would really be able to help me. ', '2020-05-10 19:44:32', '2020-05-10 19:44:32'),
(187, 'Nishanta Das', '9999680512', 'nishanta1812@gmail.com', 'Wanted to understand a 2-3months home cooked diet and want to lose weight upto 10kgs', '2020-05-11 11:22:18', '2020-05-11 11:22:18'),
(188, 'Chelston Pinto', '9886069313', 'chelston@rapidsportfitness.com', 'Hello,\r\nI\'m a S&C coach and Footballer in Bangalore. My goal is to increase muscle as of now and be explosive at the same time since its required for my sport. I have a 2 month off season period as of now where I can lift after which I go back to the football program. \r\nI\'m basically looking for guidance and motivation to keep at it everyday and consistency in eating!\r\nPlease do let me know how you go about it and what you suggest. \r\nThanks', '2020-05-11 15:57:59', '2020-05-11 15:57:59'),
(189, 'Bala bharathi ', '8220140633', 'balabharathi1718@gmail.com', 'Hi \r\nCame across your profile  \r\nWanted to know about your online training packages \r\n\r\nEarlier i weighed 88.8 kgs and at present Im @ 80 kgs ( 2kgs increased during this lockdown, Had reduced around 12.5 kgs in a span of 3 months ) \r\n\r\nMy goal is to reach 65kgs i.e to reduce 15kgs from my current weight \r\n\r\nLooking forward to your reply', '2020-05-11 20:41:06', '2020-05-11 20:41:06'),
(190, 'Verna Fernandes ', '9917777777', 'vernafernandes27@gmail.com', 'Hi There,\r\nCan i get someone to contact me on WhatsApp please? I\'d like to know more.  \r\n00971528870889.\r\nIt was giving me an error while entering my number in the above field.', '2020-05-13 01:34:50', '2020-05-13 01:34:50'),
(191, 'Sayantika Roy', '9632703908', 'sayantika650@gmail.com', 'Hi, I wanted some guidance to get back on track to working out which halted due to the lockdown. Please do let me know how I can get in touch with you for home workouts and diet plans. \r\nPS: As a substitute for dumbells I have resistance bands to workout.', '2020-05-13 16:02:05', '2020-05-13 16:02:05'),
(192, 'Nupur gupta', '9891675561', 'nupur.panav@gmail.com', 'Hi. I want to loose weight and get fit. Can u please guide me about your program.', '2020-05-13 18:10:24', '2020-05-13 18:10:24'),
(193, 'Suraj Venkatesh', '7892968595', 'surajv316@gmail.com', 'I saw your fitness program on instagram. I would like to know as to how this works. I used to be fit, but I injured my back during workout. Found out it was a slipped disc. It\'s been 5 year\'s since the incident. I would like to know if taking into consideration could I be trained and transformed. ', '2020-05-14 21:53:36', '2020-05-14 21:53:36'),
(194, 'Vir Britto', '9725797950', 'virbritto@gmail.com', 'Hi, I had previously enrolled for the 3 month online programme but due to lack of effort and consistency on my part I l did not make the most of it and in fact have lost all gains made. \r\nHowever, I have made a conscious decision to get my health and wellness on track so I would like to enroll for the 6 month programme to get the most of it and come out a changed person. ', '2020-05-16 01:36:25', '2020-05-16 01:36:25'),
(195, 'Asha Elza Jacob', '9177435744', 'aj2782@columbia.edu', 'Need to understand training plans and diet plans. Planning on taking a 3 month membership', '2020-05-17 08:14:48', '2020-05-17 08:14:48'),
(196, 'Sanjana Shivashankar', '7406072208', 'sanjanasshankar@gmail.com', 'Hi,\r\nI wanted to start off with the online coaching and I\'ve subscribed to the three-month plan. I\'ve made the payment on 16th May, Saturday. Wanted to know how to take this further.', '2020-05-19 20:18:26', '2020-05-19 20:18:26'),
(197, 'Yash', '0899654272', 'yashgole14@gmail.com', 'Hello,\r\nI would like to take up online coaching which includes nutrition plans as well. I stay in Dublin and do not have access to any weights at the moment. I have a road bike. My goal is to lower down my body fat percentage. Could you please confirm if I can opt in for the online plan and share some more details. Thanks in advance', '2020-05-20 16:29:01', '2020-05-20 16:29:01'),
(198, 'Ana Maria Saldanha', '9632676409', 'anamaria.saldanha@gmail.com', 'Hi Ralston,\r\nI\'ve heard so many good things about your online coaching and have been referred to you by a friend, Marc Saldanha. Could I talk to you about different options available and how exactly does it work? I live in London and am available via email and visa Whatsapp on the info provided above. \r\nThanks,\r\nAna', '2020-05-22 20:39:42', '2020-05-22 20:39:42'),
(199, 'MITHUN PUTTAMADAIAH', '0879257237', 'mp239u@gmail.com', 'Hey Guys,\r\n\r\nI\'m Mithun (Male, aged 32yrs) and have been following you for quite a while on instagram. I\'m based in Dublin, Ireland and given the COVID crisis, all the gyms are closed until August. So here I am looking to get some program/guidance to get me fitter. I would like to discuss about the program and want to learn how we go about this as I\'m equipped only with kettlebells (6 & 8kgs) and some resistance bands. Let me know if I need to first make a payment or if we can talk and I then make the payment right after. You guys can reach me on the given number over Whatsapp audio or specify a time and I will call you guys.\r\n\r\nThanks,\r\nMithun\r\n+353-879257237', '2020-05-23 05:31:33', '2020-05-23 05:31:33'),
(200, 'Darshit Bhavsar', '7034380622', 'darshit.b@gmail.com', 'Hello Sir,\r\n\r\nI would like to know the program details. I am interested in joining the 6-months program. Let me know when is a good time to talk and i can give you a call.\r\nThe area code is +1 in my contact number. It wouldn\'t let me put the area code for international.', '2020-05-23 22:26:53', '2020-05-23 22:26:53'),
(201, 'Ankit Badkur', '9981760763', 'ankitbadkur88@gmail.com', 'Hi, I want to enquire about the online coaching services you provide. ', '2020-05-24 15:25:34', '2020-05-24 15:25:34'),
(202, 'Rohan Shetty', '2027903077', 'Rohan.k.shettyms@gmail.com', 'Hey Team,\r\n\r\nI am an Operations Manager at Amazon currently residing in Richmond, Virginia, USA. I currently work 4 days a week Sundays to Wednesdays and walk approximately 14-20k steps during those days. I am skinny but I have some amounts of fat around my waist. I have been looking to get into working out on a regular basis and have followed Ralfitness on Instagram for quite a while. I wanted to know what kind of options the team has for me considering the fact that I am not in India and what kind of services do you offer.\r\n\r\nThanks,\r\nRohan Shetty', '2020-05-24 18:45:26', '2020-05-24 18:45:26'),
(203, 'Iinesh Reddy ', '8050640334', 'iinesh94@gmail.com', 'Hi\r\nI just bought a 3 months plan, I came to know about you by my friends, I wanted to be fit with neat body\r\n\r\nThank you', '2020-05-24 19:54:27', '2020-05-24 19:54:27'),
(204, 'Sourabh Bhattacharya', '8105529360', 'sourabh.bhatta91@gmail.com', 'Hi. Want to understand a bit about how the whole process works. Would be great if I could talk to someone.', '2020-05-24 22:50:48', '2020-05-24 22:50:48'),
(205, 'SHEETAL', '7838119794', 'sheetalghai1987@gmail.com', 'Hi,\r\n\r\nI wanted to enquire regarding your individual membership packages as I am interested in enrolling the same. \r\n\r\n1.What all does your package include. Is it both workout and diet.\r\n2.Secondly, how do you provide the diet and at what frequency do you change the diet . \r\n3 Also, how do you track the progress considering its an online program.\r\n4. Do you provide 24*7 customer support. e.g if someone wants to check about some meal option or any other query.\r\n5 Does the diet vary depending upon the individuals goals. Like if someone wants weight loss while someone else focuses on weight loss followed by toning.\r\n\r\nLooking forward for your response.\r\n\r\nThanks,\r\nSheetal\r\n', '2020-05-24 22:55:54', '2020-05-24 22:55:54'),
(206, 'Akhila Vijay ', '9292786621', 'akhilavijay98@gmail.com', 'Hi, \r\nI am interested to sign up for the 6 month service with my main aim being fit with lower fat percentage. I have borderline thyroid issues. Also, I live in Denver, USA. Please reach out to me with additional information and if you operate where I live. \r\nLooking forward to hearing from you! ', '2020-05-25 07:47:01', '2020-05-25 07:47:01'),
(207, 'Sayan Chakraborty', '9932738889', 'sayan2008@gmail.com', 'Hi Ralston,\r\n\r\nI have been following you for a long time on youtube. Professionally I am a scientist (have a PhD degree) and am 31 years old. I am quite lean. My weight is 64 and the height 5ft 6inch. I am training to run better and build (maintain) a decent physique (maybe a six-pack :P).  Could you help me out with this? Once I hear from you, I can pay for the membership (maybe for three months to start with).   Thanks, Sayan', '2020-05-25 19:31:31', '2020-05-25 19:31:31'),
(208, 'Prashant salunkhe', '9552222913', 'prashantsalunkhe1993@gmail.com', 'I\'m interested plz Support me..', '2020-05-26 17:05:04', '2020-05-26 17:05:04'),
(209, 'Chryselle Fernandes', '9620787526', 'fernandeschryselle@gmail.com', 'Hi Team, I got to know about the online coaching program you\'ll offer through a friend and have been following your Instagram account ever since. I want get myself enrolled for 3 months. Would be interested to know more about the coaching program. Also I do have a history of PCOS. ', '2020-05-28 17:13:26', '2020-05-28 17:13:26'),
(210, 'Miss Gayatri Sharma', '8169105169', 'gayatrisharma0506@gmail.com', 'Hello,I was interested in these online fitness coaching.. Please ,guide me through..I am quite dicey about this.. Need help.', '2020-05-29 11:54:30', '2020-05-29 11:54:30'),
(211, 'Ramachandra Reddy', '7780545899', 'ramachandra.ism@gmail.com', 'Hi, is it possible to get in shape with home workouts. I have no access to gym but have access to a couple of 10kg dumbles. I can purchase a couple of resistance bands. I wanted to subscribe for a 3 month pack ', '2020-05-30 13:11:10', '2020-05-30 13:11:10'),
(212, 'Chaitanya ', '8639663023', 'chaitu555@live.com', 'I had seen results of people \r\nI need some detail information. In what way is it different from other online coaching? ', '2020-05-31 23:52:11', '2020-05-31 23:52:11'),
(213, 'Kishan K', '8496896722', 'kishnk118@gmail.com', 'Looking for job at your company for the Full Stack Developer position. Please share me your company HR email address. ', '2020-06-03 13:07:07', '2020-06-03 13:07:07'),
(214, 'Akshitha.R', '9025014540', 'akshitharamalingam@gmail.com', 'Hi, This is Akshitha . I\'m a content writer, Came to know that you are looking for one through my friend Ambiga Gayatri.Would love to work along,sending my sample works to your mail.If your intrested kindly do get in touch with me.\r\nThanks', '2020-06-05 18:16:09', '2020-06-05 18:16:09'),
(215, 'Daoud Shafique', '8476665045', 'dawudshafique95@gmail.com', 'hi, i was interested in getting a membership for my friend, is something like that possible?\r\n\r\nThanks', '2020-06-07 22:36:02', '2020-06-07 22:36:02'),
(216, 'Smitha', '9880113181', 'smitha2612@gmail.com', 'Is it possible that only diet plan can be provided.', '2020-06-08 15:33:49', '2020-06-08 15:33:49'),
(217, 'Royston Mascarenhas', '8182249136', 'taproy098@gmail.com', 'Hi Ralston,\r\nI paid the amount for the three month plan. I got a mail with a payment confirmation. I do not know how to proceed with the training. Please can you guide me on this?', '2020-06-09 12:00:42', '2020-06-09 12:00:42'),
(218, 'Sahil Deshmukh', '9657710990', 'sahildeshmukh0990@yahoo.com', 'What\'s the procedure for subscribing the online training plan, please let us know the information that how to enroll ', '2020-06-10 16:41:43', '2020-06-10 16:41:43'),
(219, 'Vasundhara Singh', '8512870572', '4vasundhara.singh@gmail.com', 'Hey, \r\nI have been meaning to lose weight and eventually get toned up. I have never really worked out before so my stamina is pretty bad. \r\nI see that you have an option of both gym workout as well as home workout. I do have a gym at home but am not very familiar with the equipments. Could you please let me know the difference between the two and which one is more beneficial? \r\nThank you!', '2020-06-15 19:34:32', '2020-06-15 19:34:32'),
(220, 'Vasundhara Singh', '8512870572', '4vasundhara.singh@gmail.com', 'Hey,\r\nI have been wanting to lose weight and get toned up. I have never really worked out before so my stamina is pretty bad. \r\nI see that you have the option of gym workout as well as home workout. I do have a gym at home but am not very familiar with the equipments. Could please let me know the difference between the two? \r\nThank you!', '2020-06-15 20:00:48', '2020-06-15 20:00:48'),
(221, 'Gerald Joseph', '3063511556', 'geraldjmj@gmail.com', 'Hello Ralston,\r\nI have been following you for a couple of years now and I am thinking of signing up for some personal training but I have a couple of questions.\r\n\r\n- I am not in India, I live in Canada. How does the coaching go considering the time difference?\r\n- I have been obese for a few years now. I have been lifting weights but I lack motivation hence I have been back and forth between 115 kgs to 95 kgs. Currently i weight 112 kgs, at my heaviest I used to weight 135 kgs.\r\n- Considering the current Covid situation, gyms are closed here but i have a basic gym at home - Elliptical, Bench, dumbells, weights and some rods. \r\n- My main issue is accountability, is there a daily check-in? Hows does that work?\r\n\r\nLastly, how do I pay if I am interested. \r\n\r\nThank You', '2020-06-16 20:51:46', '2020-06-16 20:51:46'),
(222, 'Viren Kothari', '8050092710', 'vkothari704@gmail.com', 'Hi, before I enrol I wanted to know how the entire programme is going to be what kind of workouts Ill be give and will there be any tests before setting a plan for me.', '2020-06-18 19:04:26', '2020-06-18 19:04:26'),
(223, 'Garfield Ribeiro Sa ', '9158185203', 'garfsa21@gmail.com', 'Im 59 70kgs , my biggest issues are my nutrition and setting a goal and sticking to it , been working out for almost 8 years now not with consistency though , however I barely see any results all that happens is I become either bulked up or too thin with no definition...Im looking for proper guidance and support and Im considering joining your programme ', '2020-06-19 14:09:37', '2020-06-19 14:09:37'),
(224, 'Hemalatha J', '9445035554', 'hemaraghu@yahoo.com', 'Hi.  I spoke to Pawan.  I want to sign up with Ral fitness.  My kids Shruthi and Shravan have signed up for 3months recently - a couple of days back.  Would like to know/seek your advice if I can avail of the family discount.  pls, advise the amount I must pay.  ', '2020-06-19 15:04:09', '2020-06-19 15:04:09'),
(225, 'Akshay', '9620626302', 'akshay.60@live.com', 'Do you think I can apply for the 3 month program. And still work during quarantine?', '2020-06-20 17:10:27', '2020-06-20 17:10:27'),
(226, 'Likitha Raj', '9731779922', 'likithamraj@gmail.com', 'Do you train in any fitness centres?', '2020-06-22 20:02:57', '2020-06-22 20:02:57'),
(227, 'Chinmay', '8861353570', 'look4chinmay@gmail.com', 'Folks, what are the timings for online classes? Also, if I wish to take up only the online training classes, what would be the cost? Thanks!', '2020-06-23 01:34:58', '2020-06-23 01:34:58'),
(228, 'Sagar Arya', '8473808080', 'sagararyapanchal@gmail.com', 'Hello Ral fitness,\r\n\r\nI\'m living a very unhealthy lifestyle.\r\nNeed to lose weight\r\n\r\nDetails :-\r\nHt.  - 168cm\r\nWt -.  71 kg', '2020-06-23 22:32:28', '2020-06-23 22:32:28'),
(229, 'Larissa Fedric Quadros', '9762650311', 'quadroslarissa03@gmail.com', 'I wanted to know, if I take the 6 months option - monthly how much do I have to pay ? \r\nAlso I have braces, there are many things I cannot eat and my goal is to loose belly fat which is super important for me, how long will it take me ? ', '2020-06-25 13:54:42', '2020-06-25 13:54:42'),
(230, 'Akhil Suresh', '8089869685', 'akhilsureshkarayil@gmail.com', 'Hi Ral, I have seen almost all of your instagram posts. I am really motivated by how your clients transform into healthy life. I would also like to be a part ralfitness family. I am currently studying in Canada. I am 28years old. I have been fatty since 5th standard. My Lower body has way more fat than my upper body. I am 96Kg now. My goal is to reduce my weight as well as fat (especially from my butt and thighs) and build muscle at the same time. I need to reduce my weight to 75kg (atleast 80Kg) as possible. So, I need your help to do it. Gyms are opening here on July 29th. They allow only one hour section per day. I have classes too. I can go to gym 5 days a week (sat, sun, mon, tue and wed). i need help with diet and nutrition as well.\r\nI am providing my whatsapp number along with this:\r\nMy whatsapp number : +918089869685\r\nMy Canada Number : +17059754464\r\nEmail Address: akhilsureshkarayil@gmail.com', '2020-06-25 21:19:52', '2020-06-25 21:19:52'),
(231, 'Saiyed Kabir Refai', '9624264869', 'kabir.refai@gmail.com', 'Hello sir need customize flexible dite and workout plan for fat loss and muscle gain', '2020-06-26 15:32:55', '2020-06-26 15:32:55'),
(232, 'Rohit ', '9833252545', 'rht.lall@gmail.com', 'What kinda home workouts do u give as part of the package ?', '2020-06-27 18:16:38', '2020-06-27 18:16:38'),
(233, 'Fahim Shaikh', '9558352006', 'fshaikh8892@gmail.com', 'Hello,\r\nI love your videos. I would like to take a membership but i do not have any equipment at home. After becoming a father i have not worked out about 10months and i have gained much. I would like to know will it be possible to workout at home without any gym equipment. One of my family member named ziyad shaikh (your client) , has introduced me to your page.', '2020-06-27 22:38:32', '2020-06-27 22:38:32'),
(234, 'Mruthula', '3028281161', 'mruthula0505@gmail.com', 'Hi, I live in the US and I\'m interested in taking the 6 month individual membership plan. Is it possible to do that?', '2020-06-28 00:22:59', '2020-06-28 00:22:59'),
(235, 'Ashwini Mallad', '9845594005', 'ashwini.mallad@gmail.com', 'Hi Ralston,\r\n\r\nI had called you on Saturday and you asked me to sign up on the website. I am not sure if its the membership plan or something else.\r\n\r\nThanks,\r\nAshwini', '2020-06-28 02:12:52', '2020-06-28 02:12:52'),
(236, 'Mehul Chopra', '6361007130', 'mehulchopra322@gmail.com', 'Want to become fit and want to gain weight ', '2020-06-28 13:04:35', '2020-06-28 13:04:35'),
(237, 'Akshay S', '7022453123', 'akshaysatish1996@gmail.com', 'I am interested in building muscular lean body ', '2020-06-29 16:09:05', '2020-06-29 16:09:05'),
(238, 'Sylace Srinivasan', '9717128251', 'haisylu@gmail.com', 'Hello there,\r\n\r\nMy name is Sylace, 42 years old and I live in USA. I saw your posts in Instagram, all of them are impressive stuff. I\'m in a wheel chair because of polio and don\'t have much lower body strength. I always want to be fit so I do some upper body workouts but never had a proper plan of diet and workout procedure. \r\nAlso, I want to sign up for this program with my wife so it will be more fun. Can you please tailor work outs for a person in wheel chair? Also I like to have a quick video chat if possible so that you can assess my abilities. Pelase let me know and I can give you a call as per your convenience. Thanks for your time. \r\n', '2020-06-30 00:46:22', '2020-06-30 00:46:22'),
(239, 'Divesh Moolchandani', '8802687787', 'diveshmolchandani@gmail.com', 'Hey, I wanted to know a few things about the packs, like how would you communicate with me, and as gyms are shut till 31st of July would the workouts be without any equipment and when can I start the pack?', '2020-06-30 14:53:49', '2020-06-30 14:53:49'),
(240, 'Sahil Singhal', '9646284455', 'sahil.singhal@gmail.com', 'I want to start my fitness journey. Want to talk about plans, plan components etc.', '2020-07-01 17:53:10', '2020-07-01 17:53:10'),
(241, 'Arnav Pareek', '8511104152', 'pareekarnav@mail.com', 'Hi. Wanted to know if the workouts planned under the coaching program are also doable without weights and gym. Especially because of COVID, the gyms will not be accessible anytime soon.', '2020-07-03 17:04:56', '2020-07-03 17:04:56'),
(242, 'Deepu p kini', '8606555568', 'deepupkkylm@gmail.com', 'Need a proper diet and work out at home,', '2020-07-04 12:22:07', '2020-07-04 12:22:07'),
(243, 'Rahul khadka', '8373981005', 'rahulkhadka83@gmail.com', 'Hey there, I\'m Rahul an Ace certified personal trainer, been working with Anytime fitness in Delhi for the last two years. Is there any vacancy to start working for you as an online fitness coach?\r\nWould really appreciate your revert. \r\nRegards', '2020-07-04 17:38:27', '2020-07-04 17:38:27'),
(244, 'Aviral Jain', '9045357528', 'aviraljain8@gmail.com', 'I need to get fit', '2020-07-05 20:31:26', '2020-07-05 20:31:26'),
(245, 'Philip', '7022560047', 'philiphrct@gmail.com', 'Looking to shed about 15 kgs', '2020-07-06 02:26:02', '2020-07-06 02:26:02'),
(246, 'Sabarathinam Sivakumar', '3128410844', 'sabarathinam.s@gmail.com', 'Hi I am saba I have come across your coaching from my friends Shravans post . I am also trying to do some changes I would like to know more abt you coaching style. It would be great if we could have a chat.', '2020-07-06 02:59:10', '2020-07-06 02:59:10'),
(247, 'Sharath', '4372150604', 'sharath.subramanaian@gmail.com', 'Hey Ralston,\r\n\r\nHope youre doing well and staying safe!\r\n\r\nI heard about you from my friend, Shravan Shankar, whod told me about you and your initiatives which sound wonderful. Would love to have a chat with you to see if youd be able to help me out as Ive been trying to lose body fat but have not been as successful as Id like to be.\r\n\r\nLet me know your thoughts.\r\n\r\nThanks,\r\nSharath ', '2020-07-06 06:32:47', '2020-07-06 06:32:47'),
(248, 'Anoop R', '9535199987', 'anoopramesha47@gmail.com', 'Hey,\r\nI subscribed to the 6 month membership through the monthly billing option. What next? ', '2020-07-06 15:58:15', '2020-07-06 15:58:15'),
(249, 'Khalid khan', '0543873877', 'khalidkhaan24@gmail.com', 'Hi team, \r\n\r\nCame across your insta page and transformations are amazing, would love to be a part with you and get into a better shape. Can we have a quick chat ? 00971543873877\r\n\r\nThanks', '2020-07-07 12:49:50', '2020-07-07 12:49:50'),
(250, 'Praful Sonawane', '7977433931', 'prafulsnwn3@gmail.com', 'I want to join the online couching for 3 months, how do I process forward to join it. ', '2020-07-08 10:40:03', '2020-07-08 10:40:03'),
(251, 'Maheep', '8360048027', 'maheep6893@gmail.com', 'Hi this is maheep here, i am underweight guy, i used to eat a lot but not getting any results on the other hand it results in indigestion and even i am having slip disc issues, so is it possible for me to gain weight without gym', '2020-07-09 23:38:57', '2020-07-09 23:38:57'),
(252, 'Rishabh Gulecha ', '9740404407', 'rishabgulecha32@gmail.com', 'Hello.\r\nIm very much interested in exercising , need guidance and help for workout plans and diet to follow. Wanted to know more about ralfitness', '2020-07-10 14:51:43', '2020-07-10 14:51:43'),
