INSERT INTO `testimonials` (`id`, `name`, `designation`, `details`, `image_url`, `status`, `show_in_homepage`, `display_order`, `created_at`, `updated_at`) VALUES
(49, 'Shiva', 'Customer', 'Ive been in the IT industry for a decade. Health and fitness always took a back seat In my life, on time to hit the gym or to eat healthy due to workload was my common excuse. After working with Ralston he motivated me on a daily basis and we really built a strong bond, I absolutely loved the process. We were a team! It made me feel better each day more efficient, productive and most of all more confident. I felt like a fine tuned machine! I ended up being more active, putting myself out there and socializing a lot me. At the end of 6 months I lost 27kgs and also got engaged! The program has added so much value to my life and taught me a whole lot about nutrition and fitness!', 'https://ralfitness.s3.ap-south-1.amazonaws.com/testimonial/Shiva/1576159917.jpeg', 1, 1, 3, '2019-09-25 07:22:35', '2019-12-12 19:41:58'),
(50, 'Natalie', 'Customer', 'After struggling with finding a diet and exercise plan that worked for me, I came across Ralstons training and decided to give it a try. I am so glad I did. He created a daily meal plan tailored to my schedule, along with workouts that were different every 4 weeks. He held me accountable via DAILY  check-ins, and made alterations to the next week dependent on my results.', 'https://ralfitness.s3.ap-south-1.amazonaws.com/testimonial/Natalie/1576159918.jpeg', 1, 1, 2, '2019-09-25 07:23:28', '2019-12-12 19:41:58'),
(51, 'Bhavya', 'Customer', 'I just wanted to thank you for everything! The plan worked out great for me . Love the change up in the workouts . Def got me started in the right direction and realizing food/diet is a very important part of any goals you wanna have in the gym. Just lifting heavy things without a plan can only get you so far! Ive started to get a great idea of what works for me based off of these 12 weeks! Thanks for everything!', 'https://ralfitness.s3.ap-south-1.amazonaws.com/testimonial/Bhavya/1576159919.jpeg', 1, 1, 3, '2019-09-25 07:23:56', '2019-12-12 19:41:59'),
(52, 'Pratima', 'Customer', 'The results I have achieved since working with Ral have been incredible!  I had never worked out or ate properly before and he taught me the ins and outs of training and nutrition the right way. He held me accountable and motivated me through every step of the way, your support really did the trick! I highly recommend him to anyone, no matter your fitness goal or fitness level!', 'https://ralfitness.s3.ap-south-1.amazonaws.com/testimonial/Pratima/1576159919.jpeg', 1, 0, 2, '2019-09-25 07:25:10', '2019-12-12 19:42:00'),
(53, 'Venkat', 'Customer', 'My training experience with Ralston, hands down, has been the best decision I think I could have made. Ralston is extremely knowledgeable in his profession and very experienced on many levels. When it comes to achieving your goals, he doesnt give you just a basic plan. He specifically writes up your plan based on your goals and your body type. Ral is very personable and hands on. With Ral you dont feel as if you are just a number. I am full of question. I sometimes speak to Ral 3-4 times a week and message him daily along with daily updates. He always responds very promptly and never has he made me feel as if Im a bother, or that my questions are idiotic. I could go on for days about the reasons that Ral should be your personal trainer. Ralston is the man! Give him a shot! I promise you wont be disappointed.', 'https://ralfitness.s3.ap-south-1.amazonaws.com/testimonial/Venkat/1576159920.jpeg', 1, 0, 3, '2019-09-25 07:25:44', '2019-12-12 19:42:00'),
(54, 'Jatin', 'Customer', 'Constantly following your workout & tips\r\nThank you, brother, for being there! Love the way you teach and guide, I can see amazing results in my body. May God bless you with all the happiness in the world', 'https://ralfitness.s3.ap-south-1.amazonaws.com/testimonial/Jatin/1576159920.jpeg', 1, 0, 3, '2019-09-25 07:26:51', '2019-12-12 19:42:00'),
(55, 'Joseph', 'Customer', 'Managing in a hostel and continuously on the move between Bangalore and Pune is by no means easy! And to add to all the chaos preparing for my exams makes it extremely stressful! Once I got in touch with Ralston i really learnt how to make this sustainable, the balance he helped me bring into my life was remarkable! He has a great amount of knowledge in various topics concerning health and fitness. He gave me everything I needed to achieve my goal, but what it really comes down to is you making the changes and staying disciplined enough to reach your own goals. Ral is very motivating and encouraging, and he helps make your journey that much easier.\r\nI have learnt how to love and manage this lifestyle and make it super sustainable!', 'https://ralfitness.s3.ap-south-1.amazonaws.com/testimonial/Joseph/1576159921.jpeg', 1, 0, 3, '2019-09-25 07:27:29', '2019-12-12 19:42:01'),
(56, 'Mohsin Khan', 'Customer', 'Like most people looking to lose weight and get in shape, I thought I could do it on my own. What I could not do was eat the right foods to fuel my body due to a lack of knowledge on what my body needed so I could reach my goals and I didnt hold myself accountable. I would start a crash diet and fall off that diet, gain weight back and then some. I had heard about Ralston after I was talking about wanting to do a physique competition. I was told that he knew his stuff and could get me where I needed to be in order to reach my goal of competing. I cannot say enough great things about Ral and my experience being one of his clients. I have learned what my body needs for fuel and why.\r\nI have learned that hard work and dedication, along with a trainer who wont give up on you or your goals, even when you want to because that would be easier than doing the work, will get you the results youre after. I have been able to reach my first goal of competing. I look forward to reaching future goals with his help and seeing what my body is capable of.', 'https://ralfitness.s3.ap-south-1.amazonaws.com/testimonial/MohsinKhan/1576159921.jpeg', 1, 0, 3, '2019-09-25 07:28:39', '2019-12-12 19:42:01'),
(57, 'Nishant', 'Customer', 'I have been working with Ralston for three months now, and I have never been in better shape.  He is very professional, really knows what he does. Each month he is constantly changing my workouts and regularly making adjustments to my diet, answering any questions I have. It makes it going to the gym every week more fun, knowing youre going to see change week after week, and the routines never get boring.  In these last three months, I have seen dramatic changes in my physical appearance, my stamina has increased, along with my strength. I wanted to lose weight and tone up, and with his knowledge and help, I was able to achieve my goals. Ral youre the best brother!', 'https://ralfitness.s3.ap-south-1.amazonaws.com/testimonial/Nishant/1576159921.jpeg', 1, 0, 3, '2019-09-25 07:30:11', '2019-12-12 19:42:02'),
(58, 'Shalom', 'Customer', 'In January 2017, I was weighing 120kg which was at my heaviest, which weighed me down physically and emotionally. I was always tired, my feet, knees and back were always. I knew I needed to make a change and I vowed to myself to do so. I began eating healthier, doing cardio and some weight lifting and I began seeing weight come off. Setting goals was easy, but accomplishing them was a whole other ball game. I worked hard week in and week out, I failed occasionally but I kept pushing. I was talking with a buddy of mine at work about and he mentioned Ralston, who he was training with at that time. I was a little skeptical at first until I went to Rals site and saw all of the transformation pics of people that he had or was currently coaching. I thought I will give this a try, so I signed up for 3 months coaching and was successful during those 3 months. Before my 3 months had come to an end I had already committed myself to an additional year with Ralston.\r\nSo to make a long story short, as of February 2019 I was weighing in at 70kgs. I have completely changed my lifestyle to commit to a healthy longer life. I now see food as a means of energy or fuel and not for a means of any type of emotional relief or just to eat because I am bored.\r\nI am very thankful for Ral and glad I was introduced to him. I always try and send new clients to him to receive the same level of respect, encouragement and discipline I have received.\r\nMy body responded in the best way I could hope for to his regimen  I lost 8kgs, 2 pants sizes, and gained so much confidence, all within 12 weeks. Ral always responds promptly to any questions I may have. I am looking forward to keeping him as my coach for the next months to come.', 'https://ralfitness.s3.ap-south-1.amazonaws.com/testimonial/Shalom/1576159922.jpeg', 1, 0, 3, '2019-09-25 07:30:41', '2019-12-12 19:42:02'),
(59, 'Navi', 'Customer', 'I am Navi, a college student. When I got stressed about my studies, I ended up gaining weight. I found some of my friends to be very fitness conscious. I got inspired by them and decided to concentrate on healthy and active living. Going to the gym regularly was a big challenge for me, as I had to juggle my career and studies. I got to know about Ralston and talked to him about my dream of transforming myself. I had very less understanding about fitness. I faced challenges in terms of motivation and commitment towards fitness. Ralston helped me a lot in understanding the importance of leading a fit life. In a span of 4 months, I was able to lose a good amount of fat and I put on muscles. My whole lifestyle got changed for the better. Ralston sir made it happen  from healthy diet to workout training program, all these made a positive impact in my life.', 'https://ralfitness.s3.ap-south-1.amazonaws.com/testimonial/Navi/1576159922.jpeg', 1, 0, 3, '2019-09-25 07:31:08', '2019-12-12 19:42:02'),
(60, 'Karthik', 'Customer', 'I am Karthik, an IT professional. Since a very young age, my goal was to be successful in my career. I didnt think about my health through all the years of school and college. I spent most of my life working in an IT firm busy with a 9 to 5 job. After putting on excessive weight is when I realized how much health matters. I decided to drop weight and maintain a lean physique. I met Ralston Sir and got inspired by his thoughts. From day 1, I decided to work hard and stay dedicated. I was focused and followed each step Ralston told me to, in order to reach my goal. Just after a few sessions, I noticed positive changes in my body and lifestyle. Also my self-confidence has improved greatly which boosted my personal & professional life altogether.', 'https://ralfitness.s3.ap-south-1.amazonaws.com/testimonial/Karthik/1576159922.jpeg', 1, 0, 3, '2019-09-25 07:31:37', '2019-12-12 19:42:03'),
(61, 'Sushil', 'Customer', 'At age 48, I attempted to start lifting to get healthier, stronger and to improve my overall physique.  My attempts at working out were unsuccessful because of my diet, lack of motivation and no accountability.  After not seeing improvements, I decided to sign up with Ralston for a year to continue my transformation journey and what a journey it has been!\r\nAfter a little over a year of being with Ral, I have changed physically and I have become more confident. I know I did the work, but I could not have done this transformation without the excellent, personalized coaching from Ralston.  I plan to continue with his coaching and with his guidance.', 'https://ralfitness.s3.ap-south-1.amazonaws.com/testimonial/Sushil/1576159923.jpeg', 1, 0, 3, '2019-09-25 07:32:04', '2019-12-12 19:42:03'),
(62, 'Vinay', 'Customer', 'Overall, I am very happy with the results. Also, Just wanted to say thank you for taking the time to answer all of my questions in the beginning. I wasnt sure how responsive you where going to be initially due to my past experiences with various coaches. I was definitely surprised. You are very professional and patient. So, THANK YOU FOR THAT!\r\nI will sign back up with you at some point for sure. It was a great learning experience all around.', 'https://ralfitness.s3.ap-south-1.amazonaws.com/testimonial/Vinay/1576159923.jpeg', 1, 0, 3, '2019-09-25 07:32:35', '2019-12-12 19:42:04'),
(63, 'Ankur', 'Customer', 'Contacting Ralston is probably one of the best things Ive done for myself with goals as a lifter. He has a great amount of knowledge in various topics concerning health and fitness. He gave me everything I needed to achieve my goal, but what it really comes down to is you making the changes and staying disciplined enough to reach your own goal. Ral is very motivating and encouraging, and he helps make your journey that much easier.', 'https://ralfitness.s3.ap-south-1.amazonaws.com/testimonial/Ankur/1576159924.jpeg', 1, 0, 3, '2019-09-25 07:33:03', '2019-12-12 19:42:04'),
(65, 'Sidhartha', 'Customer', 'I have had the opportunity of working with Ral as my coach/trainer for three months now, and he has helped me reach goals far beyond my expectations. I LOST 30KGS!! He doesnt just give you a general diet and workout routine, he takes the time to focus on your individual needs and adjust accordingly each week. Hes always available to talk if you have questions and replies almost immediately. You couldnt ask for a better coach. Ive decided to continue using Ral as my coach because he has guided me step by step and I have been nothing but satisfied with the results. If youre looking to transform yourself, or just be in better shape, then Ralston is your guy!', 'https://ralfitness.s3.ap-south-1.amazonaws.com/testimonial/Sidhartha/1576159925.jpeg', 1, 0, 3, '2019-09-25 07:33:59', '2019-12-12 19:42:05'),
(66, 'Ankush', 'Customer', 'The results I have achieved since working with Ral have been incredible!  I had never worked out or ate properly before and he taught me the ins and outs of training and nutrition the right way.  I highly recommend him to anyone, no matter your fitness goal or fitness level!', 'https://ralfitness.s3.ap-south-1.amazonaws.com/testimonial/Ankush/1576159926.jpeg', 1, 0, 3, '2019-09-25 07:34:21', '2019-12-12 19:42:06'),
(67, 'Oni', 'Customer', 'Ive been training for a few years now, and I can honestly say I dont think Ive been in any better shape physically and mentally. All of the training, nutrition, and supplementation that Ralston recommends is from his experience and knowledge about products. Its amazing having a coach that shares the same love for fitness!', 'https://ralfitness.s3.ap-south-1.amazonaws.com/testimonial/Oni/1576159926.png', 1, 0, 3, '2019-09-25 07:40:59', '2019-12-12 19:42:06'),
(68, 'Nikshape', 'Customer', 'Thank you very much brother! I am so happy with the results!  I havent felt this good in a really long time, so thank you again!!  I would recommend your program to everyone! Best decision I made!', 'https://ralfitness.s3.ap-south-1.amazonaws.com/testimonial/Nikshape/1576159926.jpeg', 1, 0, 3, '2019-09-25 07:41:25', '2019-12-12 19:42:07'),
(69, 'Shankar', 'Customer', 'If youre looking for a great coach to get you to your fitness goals look no further than Ralston. He has taken me way farther than I couldve imagined. Before I met Ral I was just like most people out there. Trying to find the new diet and new training program out there.  I was spending more time on the internet than in the gym. My back and joints would hurt at times, I know it was because of my form and posture while training in the gym, I also found it impossible to put on weight! I took a look in the mirror one day and decided I had had enough. I needed to change my life. I heard about Ral fitness online coaching and decided to contact him. Am I glad I did! Ral has been there every step of the way. From week to week meal plans designed for your needs and goals, a  workout program, to supplement information. If I have a question hes always quick to respond, and keeps me accountable every week. He takes all the thinking out of it, and keeps me motivated.', 'https://ralfitness.s3.ap-south-1.amazonaws.com/testimonial/Shankar/1576159927.jpeg', 1, 0, 3, '2019-09-25 07:42:19', '2019-12-12 19:42:07'),
(70, 'Prashant', 'Customer', 'Thank you, Ralston for helping me take my physique to a level that I thought wasnt attainable. Not only has Ral been a great coach he has become a good friend. Thank you for making me a better version of myself and for boosting my self-confidence. Even though this journey was hard, I would always choose to do it again and would always choose Online Training with you, its worth it!', 'https://ralfitness.s3.ap-south-1.amazonaws.com/testimonial/Prashant/1576159928.jpeg', 1, 0, 3, '2019-09-25 07:42:49', '2019-12-12 19:42:08'),
(71, 'Srikanth', 'Customer', 'My experience with Ralston has been by far the best. not only is he available 24/7 for clients to reach him, but he is 100% dedicated at what he does, and the services he provides. The outcome to that equals greatness. I think for anyone that has some sort of fitness goal, being small or big, this is the guy you want! At the end of the day, its YOUR goals you have set for yourself and he doesnt steer away from that at all. Not to mention,this guy is packed full of knowledge. The best thing I did for myself!', 'https://ralfitness.s3.ap-south-1.amazonaws.com/testimonial/Srikanth/1576159928.jpeg', 1, 0, 3, '2019-09-25 07:43:21', '2019-12-12 19:42:09'),
(72, 'Saleem', 'Customer', 'The results I have achieved since working with Ral have been incredible! I always found it impossible to put on muscle! I had never worked out or ate properly before and he taught me the ins and outs of training and nutrition the right way.  I highly recommend him to anyone, no matter your fitness goal or fitness level!', 'https://ralfitness.s3.ap-south-1.amazonaws.com/testimonial/Saleem/1576159929.jpeg', 1, 0, 3, '2019-09-25 07:46:56', '2019-12-12 19:42:09'),
(73, 'Ziyad', 'Customer', 'Thank you again for the help and support during the transformation! Following your way of flexible dieting and training program has helped me push my body to look better than I ever thought I could. Thanks again', 'https://ralfitness.s3.ap-south-1.amazonaws.com/testimonial/Ziyad/1576159930.jpeg', 1, 0, 3, '2019-09-25 07:47:24', '2019-12-12 19:42:10'),
(74, 'Samuel', 'Customer', 'The results I have achieved since working with Ralston have been incredible! This progress in such short time is insane! Love the guy, super caring and responsive! I look at him as a mentor as he helped reach my goals, something which I thought was impossible. This experience taught me that a healthy body is a healthy mind', 'https://ralfitness.s3.ap-south-1.amazonaws.com/testimonial/Samuel/1576159930.jpeg', 1, 0, 3, '2019-09-25 07:47:56', '2019-12-12 19:42:10'),
(75, 'Nadeem', 'Customer', 'Working with the team  was the best decision I could have made. The knowledge and experience Ralston has is unbelievable, and Ive learned so much from him! I always have questions and they always get answered with a quick response, and most importantly they would always keep me motivated which truly made me enjoy the process. Whatever your goal is they will do everything possible to help you reach it. My body has completely transformed under the guidance of the team at Ralfitness and I highly recommend Ralfitness to anyone looking for not only a great coach but a great mentor. I guarantee if you make him your coach you wont ever regret it!', 'https://ralfitness.s3.ap-south-1.amazonaws.com/testimonial/Nadeem/1576159930.jpeg', 1, 0, 3, '2019-09-25 07:48:27', '2019-12-12 19:42:11'),
(76, 'Prithvi', 'Customer', 'I am very happy with the results. Thank you for taking the time to answer all of my questions. I wasnt sure how responsive you where going to be initially due to my past experiences with various coaches. I was definitely surprised!', 'https://ralfitness.s3.ap-south-1.amazonaws.com/testimonial/Prithvi/1576159931.jpeg', 1, 0, 3, '2019-09-25 07:48:55', '2019-12-12 19:42:11'),
(77, 'Shoaib', 'Customer', 'Ralston has been more like a mentor to me and helped me push through tough times. Through health and fitness I have learnt how to keep myself more disciplined and organised, which has helped me manage a number of things in my life. Thank you brother for all the health and support!', 'https://ralfitness.s3.ap-south-1.amazonaws.com/testimonial/Shoaib/1576159932.jpeg', 1, 0, 3, '2019-09-25 07:49:27', '2019-12-12 19:42:12'),
(79, 'Vini', 'Customer', '\"Most of us get into quick fix diets and workout regimes that help shed weight quickly in unorthodox ways, which is not sustainable in the long run. Team Ralfitness has mentored me in such a way that the change is not just short term, but a more balanced approach to a change in lifestyle. The program has made so much of a positive difference in my health, eating habits, and overall well-being. Thank you for the constant support and motivation! I have thoroughly enjoyed this journey!\"', 'https://ralfitness.s3.ap-south-1.amazonaws.com/testimonial/Vini/1576159932.jpeg', 1, 0, 4, '2019-09-26 05:42:41', '2019-12-12 19:42:13'),
(80, 'Aishwarya', 'Customer', '\"Ive always been skeptical of taking up coaching to avoid complex diet plans and rigorous workout regimes that are complicated to follow in the long run. Although, Ralstons program is super flexible and easy to follow. Over the past 12 weeks, Ive not only seen tremendous results, but also learned how to balance calories while not sacrificing any of the foods that I love.\r\nWith his constant support and guidance, the entire program felt absolutely effortless.\"', 'https://ralfitness.s3.ap-south-1.amazonaws.com/testimonial/Aishwarya/1576159933.jpg', 1, 1, 0, '2019-09-26 05:44:14', '2019-12-12 19:42:13'),
(81, 'Pratima and Shubham', 'Customer', '\"Thanks for your support team! You have changed our lifestyle and our lives in many ways. This wouldnt have been possible without you. We appreciate the fact that you are practical and logical in fitness journey, it has helped and taught us a lot. Your motivation and dedication has helped in transformation.\r\nAll the best to The Ral Fitness Team, keep inspiring people. You are blessed everyday! \"', 'https://ralfitness.s3.ap-south-1.amazonaws.com/testimonial/PratimaandShubham/1576159933.jpeg', 1, 0, 2, '2019-09-26 05:55:47', '2019-12-12 19:42:14'),
(82, 'Pratima', 'Customer', 'Working with the team was the best decision I could have made. The knowledge and experience the team has is unbelievable, and Ive learned so much from them! I always have questions and they always get answered with a quick response, and most importantly they would always keep me motivated which truly made me enjoy the process. Whatever your goal is the team will do everything possible to help you reach it. My body has completely transformed under the guidance of Ralfitness and I highly recommend them to anyone looking for not only great coaches but also great mentors.', 'https://ralfitness.s3.ap-south-1.amazonaws.com/testimonial/Pratima/1576159934.jpeg', 1, 0, 4, '2019-09-26 05:56:17', '2019-12-12 19:42:14'),
(83, 'Shalom', 'Customer', 'Working with the team  was the best decision I could have made. The knowledge and experience Ralston has is unbelievable, and Ive learned so much from him! I always have questions and they always get answered with a quick response, and most importantly they would always keep me motivated which truly made me enjoy the process. Whatever your goal is they will do everything possible to help you reach it. My body has completely transformed under the guidance of the team at Ralfitness and I highly recommend Ralfitness to anyone looking for not only a great coach but a great mentor. I guarantee if you make him your coach you wont ever regret it!', 'https://ralfitness.s3.ap-south-1.amazonaws.com/testimonial/Shalom/1576159934.jpeg', 1, 0, 3, '2019-09-26 05:56:57', '2019-12-12 19:42:15'),
(84, 'Simu', 'Customer', 'Hey Ralfitness, yes the nutrition and training was great. Thank you so much for your help. I have reached close to my goal cuz of you.', 'https://ralfitness.s3.ap-south-1.amazonaws.com/testimonial/Simu/1576159935.jpeg', 1, 0, 1, '2019-09-26 05:57:48', '2019-12-12 19:42:15'),
(85, 'Ekanshi', 'Customer', 'THANK YOU Ralfitness. For being this life coach.No words can express what your encouragement and support has meant to me. Guys out there looking for a transformation both physical and mental hit them up @ral_fitness.', 'https://ralfitness.s3.ap-south-1.amazonaws.com/testimonial/Ekanshi/1576159935.jpeg', 1, 0, 1, '2019-09-26 05:58:30', '2019-12-12 19:42:16'),
(86, 'Keshav Laddha', 'Customer', 'Bro, you really did it for me! Loved the accountability! Seriously a true motivator!\r\nQuality work brother! Keep killing it!', 'https://ralfitness.s3.ap-south-1.amazonaws.com/testimonial/KeshavLaddha/1576159936.jpeg', 1, 0, 3, '2019-09-26 05:59:09', '2019-12-12 19:42:16'),
(87, 'Daryl', 'Customer', '\"I work as an account manager at a communication agency. Changed my lifestyle because of the whole weight loss program :) Thankfully I could still eat the food I love (all meats) tried out different ways to cook chicken and beef. Really enjoyed my food so didn\'t have much cravings for other unhealthy fried food. Got a new found love for fruits as well. Feel much fitter and healthier now that I\'ve started playing more sports and swimming almost everyday. Made time in either the mornings or evenings whichever Convenient to exercise and the fact that I didn\'t have to go to the gym and still lose weight was really amazing.\"', 'https://ralfitness.s3.ap-south-1.amazonaws.com/testimonial/Daryl/1576159936.jpeg', 1, 0, 3, '2019-09-26 05:59:44', '2019-12-12 19:42:17'),
(88, 'Adwait', 'Customer', 'Thank you so much big bro', 'https://ralfitness.s3.ap-south-1.amazonaws.com/testimonial/Adwait/1576159937.jpeg', 1, 0, 3, '2019-09-26 06:00:16', '2019-12-12 19:42:17'),
(89, 'Vinayak', 'Customer', 'Thank you brother! Your method of coaching really really changed the way I looked at food and my approach to a fit an healthy life.\r\nNo quick fixed or any extreme diet. Fitness is a lifestyle and you taught me that!', 'https://ralfitness.s3.ap-south-1.amazonaws.com/testimonial/Vinayak/1576159937.jpeg', 1, 0, 3, '2019-09-26 06:00:53', '2019-12-12 19:42:18'),
(90, 'Ajay', 'Customer', 'Thank you for all the support ... I\'ve learnt a lot while my time training with the team ... Been a pleasure  Much appreciated you have been a bloody great change in my life', 'https://ralfitness.s3.ap-south-1.amazonaws.com/testimonial/Ajay/1576159938.jpeg', 1, 0, 3, '2019-09-26 06:01:26', '2019-12-12 19:42:18'),
(91, 'Pradeep', 'Customer', 'Getting ripped was always the problem! The team gave me the motivation and accountability I needed and most . I was the type of guy who sacrificed literally everything for fitness. No social life and food was very restricted which made me binge, there were days when I would go crazzyy! With these guys sustainability is key, the plan I followed gave me the results! I could chill enjoy my life and stay lean!', 'https://ralfitness.s3.ap-south-1.amazonaws.com/testimonial/Pradeep/1576159938.jpeg', 1, 0, 3, '2019-09-26 06:02:02', '2019-12-12 19:42:18'),
(92, 'Arun', 'Customer', '8 weeks! I still cant belive it!! Thank you guys!!', 'https://ralfitness.s3.ap-south-1.amazonaws.com/testimonial/Arun/1576159938.jpeg', 1, 0, 3, '2019-09-26 06:02:34', '2019-12-12 19:42:19'),
(93, 'Subhojit', 'Customer', 'Thank you for all the support.  I\'ve learnt a lot while my time training with the team< you guys removed that mental barrier I always had about Being fit despite my crazy work lifestyle! Been a pleasure. Thanks again Ralfitness. Much appreciated you have been a bloody great change in my life', 'https://ralfitness.s3.ap-south-1.amazonaws.com/testimonial/Subhojit/1576159939.jpeg', 1, 0, 3, '2019-09-26 06:03:05', '2019-12-12 19:42:19'),
(94, 'Madhu', 'Customer', 'After many unsuccessful attempts I was convinced that the only way to lose weight was to primarily focus on running. Although I loved weight training, I felt that giving it up was his only option to reach my goals. Through the process we worked through these mental barriers and managed to do what I love (lift weights) and with controlling my food portions I was able to reach my fitness goals!', 'https://ralfitness.s3.ap-south-1.amazonaws.com/testimonial/Madhu/1576159939.jpeg', 1, 0, 3, '2019-09-26 06:03:39', '2019-12-12 19:42:20'),
(95, 'Anish', 'Customer', 'Its been a great journey. Team Ralfitness has taught me alot about nutrtion and training which help me alot now i feel stronger and more confident than i am have ever been. This program has been life changing i appreciate the amount of time you have given me thank you for answering all my questions and queries and Thank you for your support and motivation.', 'https://ralfitness.s3.ap-south-1.amazonaws.com/testimonial/Anish/1576159940.jpeg', 1, 0, 3, '2019-09-26 06:04:22', '2019-12-12 19:42:20'),
(96, 'Krish Soni', 'Customer', 'Losing weight not only helps you to shape up your body but also changes your life.In last 3 months, I have developed confidence, positivity and discipline in my life that I was lacking in me.I would like to thank Ralston and his team to help me achieve this goal. The team guided me time to time, motivated me in life. They gave me workouts and diet plans according to my preference and time.There were times when I cheated my meals. They never said that you shouldnt have done it. They always said its fine lets get back to track from tomorrow.i would surely recommend you to go with Ralfitness if you are looking for your fitness goals. They will give their 101% to achieve your goal. There are no words that describes the teams dedication towards their work. \r\nThank you Again Ralfitness to guide me where I am!', 'https://ralfitness.s3.ap-south-1.amazonaws.com/testimonial/KrishSoni/1576159940.jpeg', 1, 0, 3, '2019-09-26 06:04:58', '2019-12-12 19:42:21'),
(98, 'Pavan Murthy', 'Operations Manager, Ral Fitness', '\"I was leading an unhealthy lifestyle without my knowledge like most of us until the day came when I finally realized what it had done to me. The bad lifestyle I was leading not only took a toll on me physically but it had a huge impact on my mental health. I went really low on confidence and had no meaning or purpose to my life.\r\nI finally decided that I needed to turn things around and tried almost everything out there to fix myself physically and mentally but nothing worked out. I realized I was not able to do it only because there was no accountability. I mean who cares if I cheat everyday?\r\nThen I finally decided to take things more seriously and signed up with Ralfitness. The guy was a gem, his energy was on a different level and I already knew that this would be the best decision I have made in a long time!\r\nI followed the program diligently not only because he held me accountable but It was also because he inspired and motivated me throughout my journey. This journey has definitely done a lot more for me than just making me feel better about myself. It has taught me various life lessons which has boosted my confidence to take up any challenge that is put in front of me.\r\nAlso, I am really grateful to have joined his journey to inspire the whole world and change the way everyone looks at fitness!\"', 'https://ralfitness.s3.ap-south-1.amazonaws.com/testimonial/PavanMurthy/1576159941.jpg', 1, 1, 1, '2019-11-12 19:25:30', '2019-12-12 19:42:21'),
(99, 'Nick & Vini', 'Couple program', '\"In the past we have tried working out at a gym, but the progress was very slow cause we lacked the direction and motivation that was needed, and ended up pulling out of the gym, thereby losing the hefty fees that we pay towards gym subscriptions.\r\nWe thank team Ralfitness for the constant guidance and support in bringing about this positive change in our lifestyle and the way we look at fitness. The kind of change we saw makes us enjoy working out together!\"', 'https://ralfitness.s3.ap-south-1.amazonaws.com/testimonial/Nick%26Vini/1576159941.jpg', 1, 1, 0, '2019-11-12 19:32:01', '2019-12-12 19:42:22'),
(100, 'Kapil', 'Customer', '\"I have worked out under many coaches but what separates Ral fitness from the rest is the diet plan they make according to our daily foods. The daily updates on physique and meal updates that is been asked. Which motivated me even more to be strict and stick to diet and program.\r\nThe other coaches were good but diet was a task buying things which I never ate,eating boiled food. Here everything is just perfect most importantly mum isn\'t worried anymore there is nothing new she has to see or make. Very grateful to be getting trained under RAL team.\"', 'https://ralfitness.s3.ap-south-1.amazonaws.com/testimonial/Kapil/1576159942.jpg', 1, 1, 3, '2019-11-12 20:07:19', '2019-12-12 19:42:22'),
(101, 'Yasir', 'Customer', '\"4 month pehle maine ral fitness sir se coaching start ki ustym mai toda mota tha but mujhy lean.muscle chaiye thy but mai darta tha ki online coaching waly kiya krpayengy diet bhi dengy sab boiled and all ..but maine inka content dekha aur inhone brosa dilaya ki yasir ye kam hojayega 4 months me and you ll get good muscles..so maine coaching start ki kamaal ki baat yeh hai inki diet me koi ubla hua item nhi hai i can eat my fav thing in diet...aur aj mai is manjil tk phuch gye ....i totally recommend ral fitness to everyone ...thanks sir you have changed my approach towards fitness and you changed me...\"\r\n-\r\nTranslated: \"4 months ago I was fat and I wanted to become lean so I took up online coaching with ralfitness. I was very skeptical about online coaching as I was scared about the diet which may include only boiled food. After seeing their content on Instagram, I spoke to Ralston and he assured me that I will reach my goal in 4 months and I\'ll be able to build good muscles. I enjoyed the process because I could eat all my favorite foods and still achieve my target.\"', 'https://ralfitness.s3.ap-south-1.amazonaws.com/testimonial/Yasir/1576159942.jpeg', 1, 1, 1, '2019-11-12 20:15:26', '2019-12-12 19:42:23'),
(102, 'Maitreyee', 'Customer', '\"When I decided to get trained for these three months, I honestly thought that it would be another strict regime. Never thought it would be fun!.This program actually taught me how to sustainably diet and exercise by maintaining a variety in food options. Team RalFitness always focused on enjoying on what you eat, which is so important and a great motivation in itself. I also learnt how significant it is to measure what you eat. After I started keeping a count on my calories, I knew precisely how much and what food I am eating. It made so much sense. I realised I always ate more than I needed to. The team was constantly motivating and was also responsive to all my doubts and questions. They would provide a good reasoning for the things that I needed to follow. They even patiently explained the exercises, when needed. Thanks to this program, now I am more mindful to check the nutrition value of all the food items that I purchase. I am very confident about maintaining this exercise and diet routine consistently.\"', 'https://ralfitness.s3.ap-south-1.amazonaws.com/testimonial/Maitreyee/1576159943.jpg', 1, 1, 0, '2019-11-12 20:21:01', '2019-12-12 19:42:23'),
(103, 'Vignesh', 'Customer', '\"Thank you for the program! Over the years, I\'ve wasted a lot of money on my diet and this whole lifestyle. With all the guidance and knowledge that I am receiving through the program I have come this far in just 3 months time. I am really very happy! The first time I saw the page I was impressed by the content and the lifestyle, Thank you team for all the guidance. I am learning and enjoying the experience\"', 'https://ralfitness.s3.ap-south-1.amazonaws.com/testimonial/Vignesh/1576159943.jpeg', 1, 1, 1, '2019-11-13 12:49:34', '2019-12-12 19:42:24'),
(104, 'Arshveer', 'Customer', '\"I dont really know what to say but this journey has made be a better man as I feel more confident & disciplined as compared 12 weeks before which is not only good for the fitness perspective but also to live a overall better lifestyle.\"', 'https://ralfitness.s3.ap-south-1.amazonaws.com/testimonial/Arshveer/1576159944.jpeg', 1, 0, 2, '2019-11-13 13:57:53', '2019-12-12 19:42:25'),
(105, 'Aditya', 'Customer', '\"This transformation not only made me look better but also helped me mentally. I tried losing weight but it was not good enough. But you have made it quite simple for me. I don\'t need to eat boiled chicken and rice. I enjoy my food which is one of the main reasons I could stay disciplined and the motivation from you just did wonders for me.\"', 'https://ralfitness.s3.ap-south-1.amazonaws.com/testimonial/Aditya/1576159945.jpeg', 1, 0, 2, '2019-11-13 14:00:36', '2019-12-12 19:42:25'),
(106, 'Kevin', 'Customer', '\"Here we go! I have always been into fitness but somewhere down the line I was losing direction. Ral fitness provided me that direction. When we started , Ralston told me that with your passion and my direction we can reach for the Stars. Being a lawyer and certified personal trainer now, Ralston and I have vivid discussions on how we can progress and reach a whole new level! A great coach and an even better friend! Sky is the limit!\"', 'https://ralfitness.s3.ap-south-1.amazonaws.com/testimonial/Kevin/1576159945.jpeg', 1, 0, 2, '2019-11-13 14:05:59', '2019-12-12 19:42:25'),
(107, 'Krish', 'Customer', '\"Losing weight not only helps you to shape your body but also changes your life! In the last 3 months, I have developed confidence, positivity and discipline in my life that was lacking in me. I would like to thank Ral Fitness who helped me achieve this goal. They guided and motivated me throughout the journey. They gave me workouts and diet plans according to my preference and time.There were times when I cheated my meals. They never said that you shouldnt have done it. They always said its fine lets get back to track from tomorrow. I would surely recommend you to go with Ral Fitness if you are looking for your fitness goals. The team will give you their 101% to achieve your goal. There is no word to describe the team\'s dedication towards their work. -\r\nThank you Again Team for guiding me to where I am!\"', 'https://ralfitness.s3.ap-south-1.amazonaws.com/testimonial/Krish/1576159946.jpeg', 1, 0, 2, '2019-11-13 14:07:46', '2019-12-12 19:42:26'),
(108, 'Yash', 'Customer', '\"So it\'s been an amazing journey with my brother and coach. For me losing fat as well as gaining muscle at a sustainable rate was quite a difficult task.\r\nAlways ended up looking skinny.\r\nAfter joining team Ral Fitness I learnt the importance of portion control. They always been there for me whenever I felt demotivated.\r\nThis is the result of 12 exhausting and rewarding weeks and definitely not a result of 27 days transformation.\r\nThank you so so much brother \"', 'https://ralfitness.s3.ap-south-1.amazonaws.com/testimonial/Yash/1576159946.jpeg', 1, 0, 3, '2019-11-13 14:10:07', '2019-12-12 19:42:27'),
(109, 'Thomas Bonny', 'Customer', '\"I would really like to thank you Team Ral Fitness for this amazing journey. Working with your plans has really helped me do some serious behavior modification. From someone who was a hardcore non-vegetarian (never touched my veggies)to someone who needs a salad for all three meals. The other day I was out was lunch and I had ordered a steak,I was taken by surprise when I realized that I hadn\'t touched the meat until I was done with all the veggies and it all happened so naturally. Working with has also helped me watch my lifestyle and my party habits. Thank you very much Rally. Thanks again!\"', 'https://ralfitness.s3.ap-south-1.amazonaws.com/testimonials/ThomasBonny/1579082903.jpg', 1, 0, 3, '2020-01-15 15:38:23', '2020-01-15 15:38:23'),
(110, 'Suraj', 'Customer', '\"Thank you so much for the support and guidance. I don\'t have anything to give you in return but I will surely pray that the team achieve great heights in the field of fitness! I really adore the simplicity. I want to adopt this quality in my life too . And also the genuine work of the team in this world of fakeness is remarkable. I have many things to say but I don\'t want to trouble you reading all this. I also want you to convey regards to Gaurav, Pradeep, Thomas and Pavan. It was an amazing journey with you and your team. Leaned so much . Literally changed my mindset towards fitness. Best wishes Team  Keep educating people all around the world.\"', 'https://ralfitness.s3.ap-south-1.amazonaws.com/testimonials/Suraj/1579083461.jpg', 1, 0, 3, '2020-01-15 15:47:41', '2020-01-15 15:47:41'),
(111, 'Karthik Parimi', 'Customer', '\"Thank you so much for guidance and support. Training under the Ral Fitness team changed my life style completely. His flexible dieting and portion control methods are played a major role in my fat loss. I really appreciate the way you guys are treating all clients. I am really waiting for our next phase of program.\"', 'https://ralfitness.s3.ap-south-1.amazonaws.com/testimonials/KarthikParimi/1579083789.jpg', 1, 0, 3, '2020-01-15 15:53:09', '2020-01-15 15:53:09'),
(112, 'Joel', 'Customer', '\"Thank you so much for guidance and support. Training under the Ral Fitness team has changed so many of my habits in a good way. Thanks a lot team for adding value in my life.\"', 'https://ralfitness.s3.ap-south-1.amazonaws.com/testimonials/Joel/1579084187.jpg', 1, 0, 3, '2020-01-15 15:59:47', '2020-01-15 15:59:47'),
(113, 'Rohith', 'Customer', '\"You guys have always been there to help me out! With all the guidance and knowledge that I am receiving through the program I have come this far in just a short time. I am really very happy!\"', 'https://ralfitness.s3.ap-south-1.amazonaws.com/testimonials/Rohith/1579084519.jpg', 1, 0, 3, '2020-01-15 16:05:19', '2020-01-15 16:05:19'),
(114, 'Siddhant Hajare', 'Customer', '\"Going through the plan has inculcated a discipline in my life that has created a very positive impact on my life. I thank the team for helping me achieve this and wish them the best\"', 'https://ralfitness.s3.ap-south-1.amazonaws.com/testimonials/SiddhantHajare/1579084821.jpg', 1, 0, 3, '2020-01-15 16:10:21', '2020-01-15 16:10:21'),
(115, 'Hariharan', 'Customer', '\"Training under Ral fitness team for the past three months have been immensely satisfying. I personally feel and visualize my progress. The best part is that, I\'ve always gotten immediate response and guidance from the Ral fitness team.\"', 'https://ralfitness.s3.ap-south-1.amazonaws.com/testimonials/Hariharan/1579084907.jpg', 1, 0, 3, '2020-01-15 16:11:47', '2020-01-15 16:11:47'),
(116, 'Rohit', 'Customer', '\"After struggling for years to lose fat not just the body weight...joining Ral fitness one of the best decision I took!! They helped me figuring out the diet portion control & workout plan that suited me very well...So thank you a lot for helping me out!!\"', 'https://ralfitness.s3.ap-south-1.amazonaws.com/testimonials/Rohit/1579085034.jpg', 1, 0, 3, '2020-01-15 16:13:54', '2020-01-15 16:13:54'),
(117, 'Anusha', 'Customer', '\"I thank the team for supporting me and motivating me to go through with the program each day. Wouldn\'t have been able to do that without them. So, thank you Team Ral Fitness.\"', 'https://ralfitness.s3.ap-south-1.amazonaws.com/testimonials/Anusha/1579085222.jpg', 1, 0, 3, '2020-01-15 16:17:02', '2020-01-15 16:17:02'),
(118, 'Darren', 'Customer', '\"Working with the team has improved my management skills and helped me cut down on so many unhealthy things in my life. Really appreciate what they\'re doing for everybody out there. Keep changing lives Team Ral fitness.\"', 'https://ralfitness.s3.ap-south-1.amazonaws.com/testimonials/Darren/1579085471.jpg', 1, 0, 3, '2020-01-15 16:21:11', '2020-01-15 16:21:11'),
(119, 'Namrata', 'Customer', '\"Ive always wanted to learn and understand nutrition and Ral Fitness has helped me so much! I now understand what are the right things to eat and to also add the foods that I really enjoy into my diet but in the right amounts. I\'m looking forward to learn more from you guys and to keep this fitness journey going. Ive seen tremendous results and most importantly they were very supportive and always there to answer all my questions, Thank you so much!\"', 'https://ralfitness.s3.ap-south-1.amazonaws.com/testimonials/Namrata/1579086058.jpg', 1, 0, 3, '2020-01-15 16:30:58', '2020-01-15 16:30:58'),
(120, 'Annesha Mazumdar', 'Customer', '\"The journey with team Ral Fitness has been amazing, not only did I lose weight but I have built a very healthy relationship with food. I don\'t feel anything close to deprived in fact, I feel very fit and healthy and I still lose weight which has not just helped me physically but also mentally! I go for my regular walks and doing my home workouts which I really enjoy, to be honest, this is something that I never did! The whole process has increased productivity in all spheres of my life, It been just an amazing journey!! Thank you guys!\"', 'https://ralfitness.s3.ap-south-1.amazonaws.com/testimonials/AnneshaMazumdar/1579086314.jpg', 1, 0, 3, '2020-01-15 16:35:14', '2020-01-15 16:35:14'),
(121, 'Sakib', 'Customer', '\"6 months ago I was around 120 kgs and I\'m down by 40 kgs, this program has taught me that fitness is no rocket science, stick to the basics and you will be good to go. I highly recommend this fitness program! With the quality, these guys put in you\'re sure to stay motivated and consistent!\"', 'https://ralfitness.s3.ap-south-1.amazonaws.com/testimonials/Sakib/1579086471.jpg', 1, 0, 3, '2020-01-15 16:37:51', '2020-01-15 16:37:51'),
(122, 'Nikhil', 'Customer', '\"In the past I have tried working out at a gym, but the progress was very slow because we lacked the direction and motivation that was needed, and ended up pulling out of the gym, thereby losing the hefty fees that we pay towards gym subscriptions.\r\nI thank team Ral fitness for the constant guidance and support in bringing about this positive change in our lifestyle and the way we look at fitness. The kind of change I saw makes me enjoy working out now!\"', 'https://ralfitness.s3.ap-south-1.amazonaws.com/testimonials/Nikhil/1579087074.jpeg', 1, 0, 3, '2020-01-15 16:47:54', '2020-01-15 16:47:54'),
(123, 'Siddhant Hajare', 'Customer', '\"I love fitness but because of a busy lifestyle and junk food I messed up with everything..I want to be fit for my lifetime event so I was searching for a good genuine trainer and I found Ral Fitness I was really impressed with content... With the guidance and knowledge my lifestyle is literally changed... Workout and diet was customized perfectly muze bhi believe nahi ho raha 3 months me itna diff ho skta h .. people are asking that this is natural or what? Without your guidance this is not possible for me... now feeling more confident. Thank you very much sir \"', 'https://ralfitness.s3.ap-south-1.amazonaws.com/testimonials/SiddhantHajare/1580907691.jpeg', 1, 0, 2, '2020-02-05 18:31:31', '2020-02-05 18:31:31'),
(124, 'Vignesh Rajan', 'Customer', '\"First of all, I wish to thank the Ral fitness team for this amazing journey. These days I really learned how to be consistent, which I didn\'t do before. And now really I have good eating habits and good knowledge about fat loss. Immediate responses and good guidance of the Ral Fitness team made the program really satisfying...\"', 'https://ralfitness.s3.ap-south-1.amazonaws.com/testimonials/VigneshRajan/1580907986.jpg', 1, 0, 4, '2020-02-05 18:36:26', '2020-02-05 18:36:26'),
(125, 'Anil', 'Customer', '\"I thank the team for helping me reach my fitness goals. They have been motivating and supporting me throughout the program and made sure I pushed myself, I\'ve struggled with lose skin and this has really helped. I thank the team for their work, Wouldn\'t have been able to do this without you guys.\"', 'https://ralfitness.s3.ap-south-1.amazonaws.com/testimonials/Anil/1580908040.jpeg', 1, 0, 3, '2020-02-05 18:37:20', '2020-02-05 18:37:20'),
(126, 'Gaurav Lamba', 'Customer', '\"Joining Ral fitness was a great experience. He not just helped me build a better physique but also changed my mental aspect of fitness. Throughout the journey, he constantly supported me mentally which helped me to stay on track and be consistent throughout the journey. Forever grateful to RAL FITNESS.\"', 'https://ralfitness.s3.ap-south-1.amazonaws.com/testimonials/GauravLamba/1580908189.jpg', 1, 0, 4, '2020-02-05 18:39:49', '2020-02-05 18:39:49'),
(127, 'Ganasai', 'Customer', '\"Thanks for the guidance brother, the way u motivate daily gave me an additional boost to reach this the diet has been very flexible and your response within minutes all together you really helped me a lot\"', 'https://ralfitness.s3.ap-south-1.amazonaws.com/testimonials/Ganasai/1582026601.jpeg', 1, 0, 2, '2020-02-18 17:20:02', '2020-02-18 17:20:02'),
(128, 'Vinayak', 'Customer', '\"My fitness journey with Ral fitness has been very good ..he tracked my macros and workout and weight regularly that helped me to achieve my fitness goals ...his videos in YouTube and Insta about food and workout inspired me very much ..After my cut will start my lean bulk with Ral fitness and I thank him very very much for helping me out\"', 'https://ralfitness.s3.ap-south-1.amazonaws.com/testimonials/Vinayak/1582611360.jpeg', 1, 0, 3, '2020-02-25 11:46:00', '2020-02-25 11:46:00');
INSERT INTO `testimonials` (`id`, `name`, `designation`, `details`, `image_url`, `status`, `show_in_homepage`, `display_order`, `created_at`, `updated_at`) VALUES
(129, 'Vaisakh', 'Customer', '\"This took me some time to write, but putting thoughts to words when it comes to creating a vision for your physique is something with Ral and his team has helped me with immensely.\r\nThe science behind the nutrition and lifting, going from basics and keeping me motivated has been something immense.\r\nRight from keeping me accountable, to helping with injuries and the fact that the responses are precise shows Ral and his team\'s commitment and also their love for fitness.\r\nKeep doing the good work guys keep inspiring and let those gains flow.\"', 'https://ralfitness.s3.ap-south-1.amazonaws.com/testimonials/Vaisakh/1583150609.jpeg', 1, 0, 2, '2020-03-02 17:33:29', '2020-03-02 17:33:29'),
(130, 'Ziyad', 'Customer', '\"First of all, I wish to thank the Ral fitness team for this amazing journey. These days I really learned how to be consistent, which I didn\'t do before. And now I really have good eating habits and good knowledge about fat loss. Immediate responses and good guidance of the Ral Fitness team made the program really satisfying..\"', 'https://ralfitness.s3.ap-south-1.amazonaws.com/testimonials/Ziyad/1583758515.jpeg', 1, 0, 4, '2020-03-09 18:25:15', '2020-03-09 18:25:15'),
(131, 'Rishab Jain', 'Customer', '\"Its been incredible 12 weeks! There was so much to learn from the team! Right from discipline and consistency with regards to diet and workout! which I lacked earlier! Initially I started with scepticism and anxiousness whether the process will work will I be able to reach my goals! As time passed I could see results which made me believe I could do it! All this was possible because of the constant guidance and help from Ral fitness team! Honestly, I enjoyed the process! I enjoy my diet and enjoy workouts which was not the case earlier! And After completing the online coaching of 3 months I believe my fitness journey has just begun! Thank you Ral fitness team\"', 'https://ralfitness.s3.ap-south-1.amazonaws.com/testimonials/RishabJain/1584359203.jpeg', 1, 0, 4, '2020-03-16 17:16:43', '2020-03-16 17:16:43'),
(132, 'Rutu Shah', 'Customer', '\"It was an amazing journey with the team of Ralfitness. I have been working out since 2 years but had very little knowledge of quantified nutrition. After joining his team, learned a lot how to enjoy food and still lose weight. The diet and workout plan provided was always as per my taste and never felt like boring. Instead it is a lifestyle for me now. The constant support and motivation provided by Ralston and team was incredible. Be it home workout or out door workout he always had a plan for it. I was able to see the results in couple of weeks which kept me motivated and stick to the plan. Lastly, this journey has changed my lifestyle and I am thankful to Ralston and his team for their efforts..\"', 'https://ralfitness.s3.ap-south-1.amazonaws.com/testimonials/RutuShah/1585637013.jpg', 1, 0, 3, '2020-03-31 12:13:33', '2020-03-31 12:13:33'),
(133, 'Anshumaan Singh', 'Customer', '\"I have been very active in sports and training but somehow was not able to get desired results, this is where the RAL fitness team came in and guided me with how much of training and food is required to get the desired result. Thus their experience helped me to get the result which I would have achieved in a long time by myself and as fitness is a journey, not a milestone looking forward to the next achievement with the team and so on!\r\nCheers!\"', 'https://ralfitness.s3.ap-south-1.amazonaws.com/testimonials/AnshumaanSingh/1586347398.jpeg', 1, 0, 3, '2020-04-08 17:33:18', '2020-04-08 17:33:18'),
(134, 'Sankalp', 'Customer', '\"I believe fitness is not just about physical well being but more about overall well being.\r\nIt\'s a complex mechanism which Ral Fitness has helped me a lot with, to understand. And made it easy and interesting. Like everyone, I am a fan of food but no matter how many fitness programs I have joined, with any level of devotion, never could I actually get myself to enjoy the process and not look at fitness as a task!\r\nBut Ral and the team did not actually change my outlook towards fitness but also have developed this urge to explore more about it\r\nI would say Ral and team, for me, have been the right person at the right time.\"', 'https://ralfitness.s3.ap-south-1.amazonaws.com/testimonials/Sankalp/1586847197.jpeg', 1, 0, 3, '2020-04-14 12:23:17', '2020-04-14 12:23:17'),
(135, 'Sainadh', 'Customer', '\"After struggling for a while with weight loss I joining Ral fitness. They helped me figure out the diet portion control & workout plan that suited me very well. So thank you guys a lot for helping me out!\"', 'https://ralfitness.s3.ap-south-1.amazonaws.com/testimonials/Sainadh/1587537587.jpg', 1, 0, 3, '2020-04-22 12:09:47', '2020-04-22 12:09:47'),
(136, 'Shaifu', 'Customer', '\"I had a major weight loss history ,but somewhere I got stuck and couldn\'t progress and eventually I was dragging down . But then Ral fitness came in . Completely changing my mindset on diet and training. Monitoring each and every meal to be a little stricter when I tend to cheat on meals . Meals have been super awesome and flexible according to my preferences . Motivating on every meal and every progress on weight loss was the cherry on cake.  His instant availability to clear random doubts were super amazing .  I feel much better physically and mentally too .I have a lot to learn and a lot more to go too. A great journey it has been with them . Thanks Ral fitness.\"', 'https://ralfitness.s3.ap-south-1.amazonaws.com/testimonials/Shaifu/1587972032.jpeg', 1, 0, 4, '2020-04-27 12:50:32', '2020-04-27 12:50:32'),
(137, 'Nadia', 'Customer', '\" I began my Ral fitness journey in January 2020. I realised I didnt have the mental disciple to carve my nutrition journey by following another prescriptive diet. Ral Fitness definitely brought a lot of discipline to my weight loss purpose by constantly keeping me on track & accountable for my choices through WhatsApp. Their messages are motivational and they corrected not just what I ate but how & when I ate. Their teams are always accessible & so prompt with their replies.  I appreciate that they didnt steer far from my normal Khanna or comfort food. Just knowing someone else is invested in your nutrition journey on a daily basis is enough to keep you on track. Even if I cheated (which I did a lot initially ) cause I traveled a heap, they made you feel  its alright, move on. I was always very diligent about workouts/ fitness, but nutrition is 80% of body transformation. Sometimes we all need that extra- nudge that can push us to new heights, team Ralfitness do a sincere job of the same with a lot of care & commitment.  Thank you so much.\"', 'https://ralfitness.s3.ap-south-1.amazonaws.com/testimonials/Nadia/1588682243.jpg', 1, 0, 3, '2020-05-05 18:07:23', '2020-05-05 18:07:23'),
(138, 'Sahil Gupta', 'Customer', '\"I hired a lot of online trainers in my fitness journey.But I never got the results.Then I lost confidence in myself that I cannot transform my body...7 months before today I was scrolling Instagram and I came to know about Ral fitness. I thought I would join online training for the last time. If I cannot succeed in this, then I will give up my fitness. I approached Ral Fitness and we started training in November 2019. He put me on a very balanced diet. He asked me my complete history first, then he made my diet and training according to my preferences. One thing there are big fitness trainers, they say that when you are on a fat loss diet then you should not eat carbs, high protein should be your first priority and you should avoid ghee and all stuff. But Sir did not do anything like that. He kept me on a very good diet and kept on basic Indian food. I was eating a lot of ghee, fruits , and many more. Sir always used to motivate me and whenever I had any problem, I used to Whatsapp him my query and I would get a reply in 1 or 2 minutes. Team Ralfitness transformed not only my body but also my life. 6 months ago people used to tell me that you do so much gym, you do such a strict diet, you do not get results. I told this to my Sir too, he told me that we will answer them by transforming our body.\r\nI have made a decision clearly. As long as I am in fitness. If I have a coach, it will be Team Ral fitness.\"', 'https://ralfitness.s3.ap-south-1.amazonaws.com/testimonials/SahilGupta/1589182146.jpeg', 1, 0, 3, '2020-05-11 12:59:06', '2020-05-11 12:59:06'),
(139, 'Jayash Bardiya', 'Customer', '\"Working with Team Ralfitness was extremely great. They completely took care of my diet which was basic vegetarian home food full of nutrition, I had to use a minimum amount of supplements and workouts were fun. Even during the lockdown period the team were extremely dedicated to help me reach my goals. I have not only lost body fat but gained a good amount of strength and muscle which have led to enhanced quality of health. Moreover, I have improved my relation to food and prefer healthy meals over junk food. All thanks to Team Ralfitness.\"', 'https://ralfitness.s3.ap-south-1.amazonaws.com/testimonials/JayashBardiya/1590645910.jpeg', 1, 0, 3, '2020-05-28 11:35:10', '2020-05-28 11:35:10'),
(140, 'Dhiraj Jagtap', 'Customer', '\"I have no idea about diet, calories, workout routines before I joined the Ral Fitness team. I just go to gym daily and follow the bro science rules. But here I want to tell you that just because of the Ralfitness team I\'m very happy with my diet, workout and all the outcomes because the way they designed my diet plan I never felt any restrictions on eating. I\'m happy with the food I\'m eating right now. Without your guidance dieting would not be so easy for me. I appreciate the team\'s service because whenever I feel something to ask about diet they\'re always there to respond... I have so many things to say but I think this is enough for now. I hope one day you will be the biggest fitness team in India . All the best wishes...\"', 'https://ralfitness.s3.ap-south-1.amazonaws.com/testimonials/DhirajJagtap/1590646002.jpg', 1, 0, 2, '2020-05-28 11:36:42', '2020-05-28 11:36:42'),
(141, 'Sandeep', 'Customer', '\"My journey with Team Ralfitness started when I was thinking why my body wasn\'t making much progress. I was giving my 200% in the gym and was also eating healthy. The guys have been great, asking for daily updates even when you forget to send some days. Giving a plan which rotates around your daily food habits. Motivating you for being better each day. Any queries about doubt or workout or even if something I want to know, you guys have been always helpful. I haven\'t reached my ultimate goal yet but I am making progress and will reach there soon and keep working hard. You guys are doing great, keep motivating people.\"', 'https://ralfitness.s3.ap-south-1.amazonaws.com/testimonials/Sandeep/1590992542.jpg', 1, 0, 3, '2020-06-01 11:52:22', '2020-06-01 11:52:22'),
(142, 'Jerrin', 'Customer', '\"Working with Team Ralfitness has been a great learning experience for me in terms of nutrition as well as training! I\'ve learnt so many new things after coming here which have made the biggest difference in my life and things which I will continue to implement forever to have a healthy and good life. So, thank you Team\"', 'https://ralfitness.s3.ap-south-1.amazonaws.com/testimonials/Jerrin/1591598257.jpg', 1, 0, 4, '2020-06-08 12:07:37', '2020-06-08 12:07:37'),
(143, 'Ravee Shankkar', 'Customer', '\"Working with team Ralfitness was a great learning experience. My journey with Ralfitness started after following their page for a while. I used to see the everyday meal updates and workouts in insta stories which was very inspiring. So when I started the program with Ralfitness team, I got a monthly workout plan and they also asked me to send updates of meals everyday. I used to get feedback for every meal. Over the time, this feedback helped me to correct my meal portions and also incorporate a variety of healthy foods. I would get my daily dose of appreciation for eating the right amount of food which was very motivating. Even if I go off track sometimes, which I certainly did, they would simply say let\'s get back on track from tomorrow. I now have a much better idea of how to approach workouts and food than I was earlier. Thanks to everyone in Ralfitness team \"', 'https://ralfitness.s3.ap-south-1.amazonaws.com/testimonials/RaveeShankkar/1592201415.jpg', 1, 0, 5, '2020-06-15 11:40:15', '2020-06-15 11:40:15'),
(144, 'Bala', 'Customer', '\"Over the last 4 years I have gained and lost weight multiple times but it was never sustainable and I never enjoyed the process. I came across Ral Fitness on Instagram and despite having never taken any external help with my fat loss in the past I was immediately drawn to the page because of how incredibly accessible and simple the information was, and I believed very strongly that this team could finally help me understand this journey better and make it sustainable once and for all. Having completed my program I can whole-heartedly say they delivered. Thanks to Team Ral Fitness I have increased my understanding of flexible dieting and have learnt to enjoy the process. The coaches are very motivating and are always just one message away when it comes to clearing any doubts or requests you have regarding the program. I would definitely recommend them to anybody who is looking to make a LONG TERM and sustainable change to their body. Thank you guys\"', 'https://ralfitness.s3.ap-south-1.amazonaws.com/testimonials/Bala/1592893431.jpg', 1, 0, 3, '2020-06-23 11:53:51', '2020-06-23 11:53:51'),
(145, 'Shashank', 'Customer', '\"I used to travel 20 days a month for work. Excessive travel and hotel food had made me put on a lot of weight. Since I couldn\'t work out regularly, I thought diet should help. But that made me develop an eating disorder. Even my workouts were futile. That\'s when I decided to join Ralfitness.\r\nUnfortunately, just a couple of days into the membership, the gyms were shut down because of the pandemic. I thought it would be a waste of time and wanted to back out. I even paused my membership for a couple of weeks. But then, the team gave me a comprehensive home workout plan. They tracked my meals throughout the day and suggested practical changes which made a huge difference. They didn\'t even push me for supplements. Every stage, they changed the plan as per my needs. Over the last two months, I have had everything that I had avoided over the last two years and still managed to lose 8 kgs. Thanks to the team at Ralfitness for their constant support and guidance!\"', 'https://ralfitness.s3.ap-south-1.amazonaws.com/testimonials/Shashank/1593415557.jpg', 1, 0, 3, '2020-06-29 12:55:57', '2020-06-29 12:55:57'),
(146, 'Kevin', 'Customer', '\"I have been hitting the gym working out nearly for 3-4 years but never got the desired results cause somewhere something had been going wrong\r\nI used to follow Ralfitness maybe since the past one year and had seen some amazing transformations.\r\nDuring this lockdown it just happens to inspire me so much I decided to go for it and its one of the best decisions Ive made. Truly the help with diet the workout the constant monitoring of the workout and the diets the motivation everything has just been superb. The results Ive seen in these past months just by a little change in my lifestyle has taken me a long way. I have become more focused and dedicated towards an even better goal in life and thanks to Team Ralfitness in helping me throughout this journey!\"', 'https://ralfitness.s3.ap-south-1.amazonaws.com/testimonials/Kevin/1593415698.jpg', 1, 0, 2, '2020-06-29 12:58:18', '2020-06-29 12:58:18'),
(147, 'Madhu Sushmanth', 'Customer', '\"I have been working with Team Ralfitness for almost a year now and I couldn\'t be happier with results and experience. Thank you so much for incredible support my lifestyle has completely changed for the first time I feel in control with my diet I\'ve learn an important skill how to manage  calories more than physical transformation I\'ve built so many sustainable habits to be lean throughout the year\r\nThanks so much Ralfitness team\r\nLooking forward to the next journey!\"', 'https://ralfitness.s3.ap-south-1.amazonaws.com/testimonials/MadhuSushmanth/1594018451.jpg', 1, 0, 3, '2020-07-06 12:24:11', '2020-07-06 12:24:11'),
(148, 'Shravan', 'Customer', 'I was introduced to Ral Fitness through my mother and sister who had previously worked with the team. I was particularly impressed by both of their results at the end of their 3 month program. I decided that I needed a similar change in my life and joined their 6 month online program. At first I was sceptical since this was my first online training. But, as I finished my first month of training, I saw my body respond. The team always kept me in check with my meals and my weekly workout routine. I was very motivated not to stop and push through.\r\nAnd then, the lockdown happened. I now knew only little could be done given that all the gyms were closed. But the team never gave up. They quickly switched over my gym workouts with home workouts. They never lost hope and only encouraged me to push harder at home. The team always guided me well when I had doubts or concerns. They would also keep checking in on me when I hadn\'t updated them with my meals or my workouts. I am very grateful to the entire team and am looking forward to more training sessions with them.', 'https://ralfitness.s3.ap-south-1.amazonaws.com/testimonials/Shravan/1594207586.jpg', 1, 0, 3, '2020-07-08 16:56:26', '2020-07-08 16:56:26');
